INSERT INTO `themsg_blog_text` (`blog_id`, `text`, `text_parsed`) VALUES
(1, 'Can i sell/buy anything on MSG???', 'Can i sell/buy anything on MSG???'),
(2, 'Shah Satnam Ji Green S Welfare Force Wing Volunteers, Australia participated in Plantation Day organized by Grow West Melbourne at Rowsley, Victoria. The trees were planted by Volunteers at Ironbark region, 70km from Melbourne Central. The Council had about 5000 saplings to be planted and the Volunteers of Shah Satnam Ji Green S Welfare Force Wing planted these saplings by initiating the drive at 9:30 am and the drive was wrapped up by 4 pm. It was a chilled morning with 2 deg. Temperature, when the Volunteers started the Campaign and as the day progressed the temperature rose marginally to 10 degrees. But freezing cold can never deter the enthusiasm of a Green S Welfare Fore Wing member, who is determined to work his way to the destination, come what may. 85 Volunteers took part in the Drive which is highest till date.\r\nLance, Event supervisor, was very happy to see the Volunteers again as he had met them in past Drives and was aware of their commitment and passion towards a healthy and green Planet. Emma, the head of the Council was also overjoyed to see The Shah Satnam Ji Green S Volunteers again and this time in higher number than the last year which was 75, inspite of chilling temperature. After the Drive was completed successfully, afternoon tea and lunch was provided by the Council members. In addition, Lungar (charity kitchen) was arranged by sadh sangat (Devotees) for all the volunteers. The Lungar menu involved Rice with curry, fruit salad and dessert, which was quite appreciated by other volunteers and the members of the Council. These members also expressed their heartfelt gratitude towards Dera Sacha Sauda Volunteers, and their Master Saint Gurmeet Ram Rahim Singh Ji Insan, for igniting such passion amongst the Volunteers, towards Service towards Humanity.[img]http://themsg.com/themsg44/index.php/file/attachment/2015/08/eaca5f0ee79a0dae2e5dc982e894bcbf_view.jpg[/img]', 'Shah Satnam Ji Green S Welfare Force Wing Volunteers, Australia participated in Plantation Day organized by Grow West Melbourne at Rowsley, Victoria. The trees were planted by Volunteers at Ironbark region, 70km from Melbourne Central. The Council had about 5000 saplings to be planted and the Volunteers of Shah Satnam Ji Green S Welfare Force Wing planted these saplings by initiating the drive at 9:30 am and the drive was wrapped up by 4 pm. It was a chilled morning with 2 deg. Temperature, when the Volunteers started the Campaign and as the day progressed the temperature rose marginally to 10 degrees. But freezing cold can never deter the enthusiasm of a Green S Welfare Fore Wing member, who is determined to work his way to the destination, come what may. 85 Volunteers took part in the Drive which is highest till date.\r\nLance, Event supervisor, was very happy to see the Volunteers again as he had met them in past Drives and was aware of their commitment and passion towards a healthy and green Planet. Emma, the head of the Council was also overjoyed to see The Shah Satnam Ji Green S Volunteers again and this time in higher number than the last year which was 75, inspite of chilling temperature. After the Drive was completed successfully, afternoon tea and lunch was provided by the Council members. In addition, Lungar (charity kitchen) was arranged by sadh sangat (Devotees) for all the volunteers. The Lungar menu involved Rice with curry, fruit salad and dessert, which was quite appreciated by other volunteers and the members of the Council. These members also expressed their heartfelt gratitude towards Dera Sacha Sauda Volunteers, and their Master Saint Gurmeet Ram Rahim Singh Ji Insan, for igniting such passion amongst the Volunteers, towards Service towards Humanity.[img]http://themsg.com/themsg44/index.php/file/attachment/2015/08/eaca5f0ee79a0dae2e5dc982e894bcbf_view.jpg[/img]'),
(3, '[img]http://themsg.com/themsg44/index.php/file/attachment/2015/08/76961669c9c91afdc867a2a892df207e_view.jpg[/img]\r\n\r\nMany people have accepted the health tips in their lifestyle prescribed by Revered Guruji which helps in preventing diseases.\r\nGuruji suggests that dinner should not be taken late at night. Food should be taken before the sun set because the quantity of bacteria is quite less at that time.\r\nOne should wake up early morning and should try to sleep early night. The people, who have to work hard for the whole day, should go for a morning and evening walk.\r\nChew water and drink food means water should be drunk sip by sip and food should be properly chewed so that the food can be digested slowly.\r\nGuruji teaches the method of the Pranayam with meditation. It helps in enhancing the concentration. Many players have reached the International levels by adopting this method.\r\nSpecial diet chart has been developed told by Guruji by which any stout or fat person can lose his fat. People can lose up to 5-7 kilograms of weight within a week, without fasting.\r\nRecite the Holy Meditation and keep your feelings pure.\r\nEarn by working hard and do good deeds.\r\nPrefer boiled instead of fried or spicy food.', '[img]http://themsg.com/themsg44/index.php/file/attachment/2015/08/76961669c9c91afdc867a2a892df207e_view.jpg[/img]\r\n\r\nMany people have accepted the health tips in their lifestyle prescribed by Revered Guruji which helps in preventing diseases.\r\nGuruji suggests that dinner should not be taken late at night. Food should be taken before the sun set because the quantity of bacteria is quite less at that time.\r\nOne should wake up early morning and should try to sleep early night. The people, who have to work hard for the whole day, should go for a morning and evening walk.\r\nChew water and drink food means water should be drunk sip by sip and food should be properly chewed so that the food can be digested slowly.\r\nGuruji teaches the method of the Pranayam with meditation. It helps in enhancing the concentration. Many players have reached the International levels by adopting this method.\r\nSpecial diet chart has been developed told by Guruji by which any stout or fat person can lose his fat. People can lose up to 5-7 kilograms of weight within a week, without fasting.\r\nRecite the Holy Meditation and keep your feelings pure.\r\nEarn by working hard and do good deeds.\r\nPrefer boiled instead of fried or spicy food.'),
(4, '[img]http://themsg.com/themsg44/index.php/file/attachment/2015/08/b3ce5d8d9b786f78037cdcad278ff4c0_view.jpg[/img]\r\n\r\nMeditation  A Message for Restrained life\r\nLife lived with reasonable restraint is the basis for happiness. Restraint makes a man patient, well behaved and tolerant. It also develops the personality. So our Vedas and Religious scriptures teach us that even for living best life, one must live a restrained life. Then a person becomes the picture of equipoise, morally strong and detached. While performing the worldly duties, he never binds in worldly restrictions, thus by being involved in family; a man who lives with restraint can attain asceticism. This is the greatness of restrained life. Guruji also insists upon such a great life because in this materialistic world, people are eager to live an unrestrained, uncontrolled life. People are becoming the victim of many diseases and disorders due to their involvement in RAJAS and TAMAS driven by limitless desires. In brief, desire for accumulating wealth, makes a man shed restraint.\r\n\r\nSo, Guruji insists on a balanced life lived with moderation and through his teachings, he awakens the world about the greatness of such life .The same pious sermons are for everyone that none should be overpowered by selfish desires to attain wealth. By fairness and hard work, the wealth which is earned is well deserved and one must never get tense about the things that are beyond reach. But one must keep on working hard. By fighting evil thoughts and developing positive energy with meditation, one must give direction to ones life. Even after becoming an achiever in life, one should lead an ideal life which is balanced and restrained. It is the greatest virtue of a man if he remains balanced and restrained irrespective of circumstances.\r\n\r\nTrue meditation not only helps us live a happy, healthy and contented life but also ultimately helps us realise our Creator, God.\r\n\r\nWhat is Meditation?\r\nnaam shabad True Meditation is taught by True Master. No one knows that there is such a supreme power that is present inside everyone, which helps everyone in this world and even beyond. Only the Guru makes it attainable by the means of meditation.\r\n\r\nTo address and call up the Almighty through Gods words (Gurumantra) is known as meditation.\r\n\r\nThe meditation is a chant which is practically tested by the Master to deliver the soul to higher realms. Once the Soul is emancipated, one can experience God, feels his existence, realize how profoundly He changes our life for the better and helps us get rid of our tensions and troubles.But Almighty God has to be prayed for by calling his True Name, the correct method of meditation. It helps one became powerful spiritually and tap the ocean of joys within. And by meditating upon Gods words one reaches the tenth door, Gods light and sound is seen and heard. The God becomes manifest, internally.', '[img]http://themsg.com/themsg44/index.php/file/attachment/2015/08/b3ce5d8d9b786f78037cdcad278ff4c0_view.jpg[/img]\r\n\r\nMeditation  A Message for Restrained life\r\nLife lived with reasonable restraint is the basis for happiness. Restraint makes a man patient, well behaved and tolerant. It also develops the personality. So our Vedas and Religious scriptures teach us that even for living best life, one must live a restrained life. Then a person becomes the picture of equipoise, morally strong and detached. While performing the worldly duties, he never binds in worldly restrictions, thus by being involved in family; a man who lives with restraint can attain asceticism. This is the greatness of restrained life. Guruji also insists upon such a great life because in this materialistic world, people are eager to live an unrestrained, uncontrolled life. People are becoming the victim of many diseases and disorders due to their involvement in RAJAS and TAMAS driven by limitless desires. In brief, desire for accumulating wealth, makes a man shed restraint.\r\n\r\nSo, Guruji insists on a balanced life lived with moderation and through his teachings, he awakens the world about the greatness of such life .The same pious sermons are for everyone that none should be overpowered by selfish desires to attain wealth. By fairness and hard work, the wealth which is earned is well deserved and one must never get tense about the things that are beyond reach. But one must keep on working hard. By fighting evil thoughts and developing positive energy with meditation, one must give direction to ones life. Even after becoming an achiever in life, one should lead an ideal life which is balanced and restrained. It is the greatest virtue of a man if he remains balanced and restrained irrespective of circumstances.\r\n\r\nTrue meditation not only helps us live a happy, healthy and contented life but also ultimately helps us realise our Creator, God.\r\n\r\nWhat is Meditation?\r\nnaam shabad True Meditation is taught by True Master. No one knows that there is such a supreme power that is present inside everyone, which helps everyone in this world and even beyond. Only the Guru makes it attainable by the means of meditation.\r\n\r\nTo address and call up the Almighty through Gods words (Gurumantra) is known as meditation.\r\n\r\nThe meditation is a chant which is practically tested by the Master to deliver the soul to higher realms. Once the Soul is emancipated, one can experience God, feels his existence, realize how profoundly He changes our life for the better and helps us get rid of our tensions and troubles.But Almighty God has to be prayed for by calling his True Name, the correct method of meditation. It helps one became powerful spiritually and tap the ocean of joys within. And by meditating upon Gods words one reaches the tenth door, Gods light and sound is seen and heard. The God becomes manifest, internally.'),
