(1, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'module_admincp', 'Admincp', 'Admincp', 1219147675),
(2, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'logged_in_as', 'Logged in as {full_name}', 'Logged in as {full_name}', 1212102851),
(3, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'view_site', 'View Site', 'View Site', 1212102898),
(4, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'logout', 'Logout', 'Logout', 1212102912),
(5, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'admin_cp', 'Admin CP', 'Admin CP', 1212102946),
(6, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'dashboard', 'Dashboard', 'Dashboard', 1212104757),
(7, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'setting_add_group', 'Select the group your new setting will belong to. \r\n\r\nRegardless of the group it belongs to it can be accessed globally. \r\n\r\nSettings are split up into 3 groups, which are <b>Global Setting</b>, <b>Module Setting</b> or <b>Product Setting</b>.\r\n\r\n<b>Global Setting</b> are settings that are not part of any specific module or 3rd party product so it falls into a global variable. \r\n\r\n<b>Module Setting</b> are settings that belong to the specific module it is used in. The setting can still be accessed across other modules, however these settings are intended to be used only in the specific module it was created for.\r\n\r\n<b>Product Setting</b> are settings that belong to 3rd party products.', 'Select the group your new setting will belong to. \r\n\r\nRegardless of the group it belongs to it can be accessed globally. \r\n\r\nSettings are split up into 3 groups, which are <b>Global Setting</b>, <b>Module Setting</b> or <b>Product Setting</b>.\r\n\r\n<b>Global Setting</b> are settings that are not part of any specific module or 3rd party product so it falls into a global variable. \r\n\r\n<b>Module Setting</b> are settings that belong to the specific module it is used in. The setting can still be accessed across other modules, however these settings are intended to be used only in the specific module it was created for.\r\n\r\n<b>Product Setting</b> are settings that belong to 3rd party products.', 1213992518),
(8, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'setting_details', 'Setting Details', 'Setting Details', 1213992880),
(9, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'group', 'Groups', 'Groups', 1213992894),
(10, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'global_settings', 'Global Settings', 'Global Settings', 1213992913),
(11, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'module_settings', 'Module Settings', 'Module Settings', 1213992929),
(12, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'product_settings', 'Product Settings', 'Product Settings', 1213992943),
(13, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'variable', 'Variable', 'Variable', 1213992960),
(14, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'type', 'Type', 'Type', 1213992972),
(15, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'string', 'String', 'String', 1213992984),
(16, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'boolean', 'Boolean', 'Boolean', 1213992994),
(17, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'integer', 'Integer', 'Integer', 1213993005),
(18, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'array', 'Array', 'Array', 1213993015),
(19, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'defined_drop_down', 'Defined Drop-Down', 'Defined Drop-Down', 1213993026),
(20, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'value', 'Value', 'Value', 1213993039),
(21, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'language_package_details', 'Language Package Details', 'Language Package Details', 1213993059),
(22, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'title', 'Title', 'Title', 1213993072),
(23, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'info', 'Info', 'Info', 1213993093),
(24, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'submit', 'Submit', 'Submit', 1213993106),
(25, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'true', 'True', 'True', 1213993147),
(26, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'false', 'False', 'False', 1213993164),
(27, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'setting_array_example', 'Example: array("val1", "val2", "val3");', 'Example: array("val1", "val2", "val3");', 1213993190),
(28, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'setting_drop_down_example', 'Separate drop downs with commas. The first drop down will be the default drop down. (Example: drop1, drop2, drop3)', 'Separate drop downs with commas. The first drop down will be the default drop down. (Example: drop1, drop2, drop3)', 1213993229),
(29, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'setting_add_var', 'The <b>Variable</b> of your new setting is how you will identify and call this specific setting and return the given value.\r\n\r\nIf you create a <b>Variable</b> with <b>foo</b> it can be used later within the PHP script as:\r\n[php]\r\necho App::getParam(''foo'');\r\n[/php]\r\nThe above code will print out the value of foo.\r\n\r\nNote that if you add spacing or unsupported characters (alphanumeric support only) to your <b>Variable</b> it will automatically be renamed to fit the standards, which we will replace all unsupported characters or spaces with an underscore.', 'The <b>Variable</b> of your new setting is how you will identify and call this specific setting and return the given value.\r\n\r\nIf you create a <b>Variable</b> with <b>foo</b> it can be used later within the PHP script as:\r\n[php]\r\necho App::getParam(''foo'');\r\n[/php]\r\nThe above code will print out the value of foo.\r\n\r\nNote that if you add spacing or unsupported characters (alphanumeric support only) to your <b>Variable</b> it will automatically be renamed to fit the standards, which we will replace all unsupported characters or spaces with an underscore.', 1213994889),
(30, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'admincp_help', 'AdminCP Help', 'AdminCP Help', 1213995090),
(31, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'setting_add_type', 'Settings can be stored as a String, Boolean, Integer, Array or a Defined Drop-Down value.\r\n\r\n<b><u>String</u></b>\r\nStore string values that could contain alphanumeric characters or long text.\r\n\r\n<b><u>Boolean</u></b>\r\nStore a TRUE or FALSE value.\r\n\r\n<b><u>Integer</u></b>\r\nStore a numeric value.\r\n\r\n<b><u>Array</u></b>\r\nStore values within an Array.\r\n\r\n<b><u>Defined Drop-Down</u></b>\r\nStore values within an Array, however unlike the Array storage method you can only return one value which will be used when calling the parameter.', 'Settings can be stored as a String, Boolean, Integer, Array or a Defined Drop-Down value.\r\n\r\n<b><u>String</u></b>\r\nStore string values that could contain alphanumeric characters or long text.\r\n\r\n<b><u>Boolean</u></b>\r\nStore a TRUE or FALSE value.\r\n\r\n<b><u>Integer</u></b>\r\nStore a numeric value.\r\n\r\n<b><u>Array</u></b>\r\nStore values within an Array.\r\n\r\n<b><u>Defined Drop-Down</u></b>\r\nStore values within an Array, however unlike the Array storage method you can only return one value which will be used when calling the parameter.', 1213996094),
(32, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'setting_add_value', 'Settings can be stored as a String, Boolean, Integer, Array or a Defined Drop-Down value.\r\n\r\n<b><u>String</u></b>\r\nStore string values that could contain alphanumeric characters or long text.\r\n\r\n<b><u>Boolean</u></b>\r\nStore a TRUE or FALSE value. Simply select TRUE if the value for the setting you are adding should be TRUE by default.\r\n\r\n<b><u>Integer</u></b>\r\nStore a numeric value.\r\n\r\n<b><u>Array</u></b>\r\nStore values within an Array. Adding an Array is similar to how Arrays are adding in PHP. \r\n\r\nExample:\r\n[php]\r\narray("val1", "val2", "val3");\r\n[/php]\r\n\r\n<b><u>Defined Drop-Down</u></b>\r\nStore values within an Array, however unlike the Array storage method you can only return one value which will be used when calling the parameter.\r\n\r\nWhen adding a drop-down separate drop downs with commas. The first drop down will be the default drop down. \r\n\r\nExample: \r\n[quote]\r\ndrop1, drop2, drop3\r\n[/quote]', 'Settings can be stored as a String, Boolean, Integer, Array or a Defined Drop-Down value.\r\n\r\n<b><u>String</u></b>\r\nStore string values that could contain alphanumeric characters or long text.\r\n\r\n<b><u>Boolean</u></b>\r\nStore a TRUE or FALSE value. Simply select TRUE if the value for the setting you are adding should be TRUE by default.\r\n\r\n<b><u>Integer</u></b>\r\nStore a numeric value.\r\n\r\n<b><u>Array</u></b>\r\nStore values within an Array. Adding an Array is similar to how Arrays are adding in PHP. \r\n\r\nExample:\r\n[php]\r\narray("val1", "val2", "val3");\r\n[/php]\r\n\r\n<b><u>Defined Drop-Down</u></b>\r\nStore values within an Array, however unlike the Array storage method you can only return one value which will be used when calling the parameter.\r\n\r\nWhen adding a drop-down separate drop downs with commas. The first drop down will be the default drop down. \r\n\r\nExample: \r\n[quote]\r\ndrop1, drop2, drop3\r\n[/quote]', 1213996483),
(33, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'setting_add_title', 'Each setting must have a phrase added to the default language package to identify what we are editing when it comes time to edit this setting in the future. \r\n\r\nKeep the setting title short and to the point as you will also be adding a more informative phrase right after which is used to explain how a setting reacts on the site.', 'Each setting must have a phrase added to the default language package to identify what we are editing when it comes time to edit this setting in the future. \r\n\r\nKeep the setting title short and to the point as you will also be adding a more informative phrase right after which is used to explain how a setting reacts on the site.', 1213996632),
(34, 'en', 'admincp', 'phpfox', '2.0.0alpha1', 'setting_add_info', 'Add as much information as you can regarding the new setting you are adding as others may need to edit this setting in the future. \r\n\r\nInstructions on how the setting effects the site when it for example is enabled or disabled is very useful.', 'Add as much information as you can regarding the new setting you are adding as others may need to edit this setting in the future. \r\n\r\nInstructions on how the setting effects the site when it for example is enabled or disabled is very useful.', 1213996745),
