(577, 'en', 'admincp', 'phpfox', '2.0.5', 'all_items_on_the_site_store_certain_information_in_the_database', 'All items on the site store certain information in the database. Some of this information are the titles of items. By default these fields that store the items title have a limit of 255 characters, which with alphanumeric characters is a lot. However, if using non-latin characters this might not be enough and titles are cut short. This reason for this is we convert non-latin characters before they are added into the database so when they are outputted everyone can view these characters irregardless of what character-set they have. Using the tool found on this page you can enlarge these fields to store a maximum of 65,535 characters.', 'All items on the site store certain information in the database. Some of this information are the titles of items. By default these fields that store the items title have a limit of 255 characters, which with alphanumeric characters is a lot. However, if using non-latin characters this might not be enough and titles are cut short. This reason for this is we convert non-latin characters before they are added into the database so when they are outputted everyone can view these characters irregardless of what character-set they have. Using the tool found on this page you can enlarge these fields to store a maximum of 65,535 characters.', 1275386310),
