(714, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_group_cookie', '<title>Cookies</title><info>Cookie Information</info>', '<title>Cookies</title><info>Cookie Information</info>', 1213866358),
(715, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_cookie_path', '<title>Path to Save Cookies</title><info>The path to which the cookie is saved. If you run more than one site on the same domain, it will be necessary to set this to the individual directories of your site. Otherwise, just leave it as / .\r\n\r\nPlease note that your path should always end in a forward-slash; for example ''/community/'', ''/site/'' etc.\r\n\r\n<b>Entering an invalid setting can leave you unable to login to your site.</b></info>', '<title>Path to Save Cookies</title><info>The path to which the cookie is saved. If you run more than one site on the same domain, it will be necessary to set this to the individual directories of your site. Otherwise, just leave it as / .\r\n\r\nPlease note that your path should always end in a forward-slash; for example ''/community/'', ''/site/'' etc.\r\n\r\n<b>Entering an invalid setting can leave you unable to login to your site.</b></info>', 1213869795),
(716, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_cookie_domain', '<title>Cookie Domain</title><info>This option sets the domain on which the cookie is active. The most common reason to change this setting is that you have two different urls to your site, i.e. example.com and community.example.com. To allow users to stay logged into the site if they visit via either url, you would set this to .example.com (note the domain begins with a dot.\r\n\r\nYou most likely want to leave this setting blank as entering an invalid setting can leave you unable to login to your site.</info>', '<title>Cookie Domain</title><info>This option sets the domain on which the cookie is active. The most common reason to change this setting is that you have two different urls to your site, i.e. example.com and community.example.com. To allow users to stay logged into the site if they visit via either url, you would set this to .example.com (note the domain begins with a dot.\r\n\r\nYou most likely want to leave this setting blank as entering an invalid setting can leave you unable to login to your site.</info>', 1213869928),
(717, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_group_development', '<title>Development</title><info>Sample Information</info>', '<title>Development</title><info>Sample Information</info>', 1213871855),
(718, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_log_missing_images', '<title>Log Missing Image</title><info>Find and log any missing images into a log file. This could be used during the development of a new module or plug-in. \r\n\r\nIf you are running a live site make sure this setting is disabled.\r\n\r\nNote the relative location of the log file is: /file/log/phpfox_missing_images.log</info>', '<title>Log Missing Image</title><info>Find and log any missing images into a log file. This could be used during the development of a new module or plug-in. \r\n\r\nIf you are running a live site make sure this setting is disabled.\r\n\r\nNote the relative location of the log file is: /file/log/phpfox_missing_images.log</info>', 1213872261),
(719, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_attachment_valid_images', '<title>Create Thumbnails</title><info>Define what file extensions we should create thumbnails for when a user uploads an image attachment.</info>', '<title>Create Thumbnails</title><info>Define what file extensions we should create thumbnails for when a user uploads an image attachment.</info>', 1213872474),
(720, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_attachment_max_thumbnail', '<title>Thumbnail Width/Height</title><info>Define the width and height of the thumbnail that will be created after a user uploads an image. If the image uploaded is smaller then the specified width/height it will not create a thumbnail for the image.</info>', '<title>Thumbnail Width/Height</title><info>Define the width and height of the thumbnail that will be created after a user uploads an image. If the image uploaded is smaller then the specified width/height it will not create a thumbnail for the image.</info>', 1213872657),
(721, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_attachment_max_medium', '<title>Medium Thumbnail Width/Height</title><info>Define the width and height of the medium thumbnail that will be created after a user uploads an image. If the image uploaded is smaller then the specified width/height it will not create a medium thumbnail for the image.\r\n\r\nNote that the medium thumbnail is displayed on the website instead of the original image to save bandwidth.</info>', '<title>Medium Thumbnail Width/Height</title><info>Define the width and height of the medium thumbnail that will be created after a user uploads an image. If the image uploaded is smaller then the specified width/height it will not create a medium thumbnail for the image.\r\n\r\nNote that the medium thumbnail is displayed on the website instead of the original image to save bandwidth.</info>', 1213872836),
(722, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_attachment_upload_bars', '<title>Upload Inputs</title><info>Define how many upload inputs should be displayed when a user is uploading attachments for an item.</info>', '<title>Upload Inputs</title><info>Define how many upload inputs should be displayed when a user is uploading attachments for an item.</info>', 1213872933),
(723, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_group_content_formatting', '<title>Content Formatting</title><info>Format Info</info>', '<title>Content Formatting</title><info>Format Info</info>', 1213873063),
(724, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_wysiwyg', '<title>WYSIWYG Editor</title><info>Select a default WYSIWYG editor.\r\n\r\nWYSIWYG (What You See Is What You Get)</info>', '<title>WYSIWYG Editor</title><info>Select a default WYSIWYG editor.\r\n\r\nWYSIWYG (What You See Is What You Get)</info>', 1213874080),
(725, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_allow_html', '<title>Allow HTML</title><info>Set this to <b>True</b> if you would like to allow HTML on your site. Note that even with this setting enabled by default we only allow certain HTML tags we feel that will not harm your site. You can add more HTML tags by modifying the setting <b>sAllowedHtmlTags</b> which can be found in this setting group.</info>', '<title>Allow HTML</title><info>Set this to <b>True</b> if you would like to allow HTML on your site. Note that even with this setting enabled by default we only allow certain HTML tags we feel that will not harm your site. You can add more HTML tags by modifying the setting <b>sAllowedHtmlTags</b> which can be found in this setting group.</info>', 1213875281),
(726, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_allowed_html', '<title>Allowed HTML Tags</title><info>We provide a set of HTML tags we feel will give your users the ability to format their content without harming your site. \r\n\r\nYou are free to add more HTML tags you deem necessary. If you do add more tags note that we have taken steps to prevent injections from JavaScript for example so adding more tags should not cause a security risk, it can however alter the way your site looks.\r\n\r\nTo add more tags simply add the tag you wish either to the end or front of the provided tags.</info>', '<title>Allowed HTML Tags</title><info>We provide a set of HTML tags we feel will give your users the ability to format their content without harming your site. \r\n\r\nYou are free to add more HTML tags you deem necessary. If you do add more tags note that we have taken steps to prevent injections from JavaScript for example so adding more tags should not cause a security risk, it can however alter the way your site looks.\r\n\r\nTo add more tags simply add the tag you wish either to the end or front of the provided tags.</info>', 1213875545),
(727, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_xhtml_valid', '<title>XHTML Valid</title><info>Set this to <b>True</b> if you would like us to try to clean up the content being added by your users and attempt to make the site XHTML valid.\r\n\r\nNote that enabling this feature will use extra resources in order to parse all the data being added and remove or fix any unwanted HTML errors. Keeping this feature disabled on large sites would be best unless you really desire your site to be XHTML valid.</info>', '<title>XHTML Valid</title><info>Set this to <b>True</b> if you would like us to try to clean up the content being added by your users and attempt to make the site XHTML valid.\r\n\r\nNote that enabling this feature will use extra resources in order to parse all the data being added and remove or fix any unwanted HTML errors. Keeping this feature disabled on large sites would be best unless you really desire your site to be XHTML valid.</info>', 1213875737),
(728, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_wysiwyg_comments', '<title>Enable WYSIWYG</title><info>Set this to <b>True</b> if you would like to enable the usage of a WYSIWYG editor when users add a comment on an item or another users profile. \r\n\r\nNote that in order for this setting to take affect you must be using a WYSIWYG editor other then the <b>default</b> editor.</info>', '<title>Enable WYSIWYG</title><info>Set this to <b>True</b> if you would like to enable the usage of a WYSIWYG editor when users add a comment on an item or another users profile. \r\n\r\nNote that in order for this setting to take affect you must be using a WYSIWYG editor other then the <b>default</b> editor.</info>', 1213876086),
(729, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_comment_page_limit', '<title>Page Limit</title><info>Define how many comments will be displayed on a page before we add a pagination so users can continue to browse to other pages to view the rest of the comments.</info>', '<title>Page Limit</title><info>Define how many comments will be displayed on a page before we add a pagination so users can continue to browse to other pages to view the rest of the comments.</info>', 1213876191),
(730, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_keep_active_posts', '<title>Active Posts</title><info>Define how long we should keep posts active in minutes. \r\n\r\nNote that if a post passes this limit it will be displayed on the site normally, however if a post is active there will be some form of letting the user know that they have not viewed the specific thread or forum. Depending on the theme you are using this is usually identified by images and formating the title of the thread or forum to be bold.</info>', '<title>Active Posts</title><info>Define how long we should keep posts active in minutes. \r\n\r\nNote that if a post passes this limit it will be displayed on the site normally, however if a post is active there will be some form of letting the user know that they have not viewed the specific thread or forum. Depending on the theme you are using this is usually identified by images and formating the title of the thread or forum to be bold.</info>', 1213876414),
(731, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_use_hot_threads', '<title>Display Hot Threads</title><info>Set this to <b>True</b> if you would like to display <b>Hot Threads</b> in your forums. \r\n\r\nHot Threads are defined by the setting <setting>iHotThreadPosts</setting> or <setting>iHotThreadViews</setting>. \r\n\r\nDepending on those settings it will consider if a thread is popular by how many posts or views a thread has and if it surpassed the settings mentioned earlier it will be considered a <b>Hot Thread</b>.</info>', '<title>Display Hot Threads</title><info>Set this to <b>True</b> if you would like to display <b>Hot Threads</b> in your forums. \r\n\r\nHot Threads are defined by the setting <setting>iHotThreadPosts</setting> or <setting>iHotThreadViews</setting>. \r\n\r\nDepending on those settings it will consider if a thread is popular by how many posts or views a thread has and if it surpassed the settings mentioned earlier it will be considered a <b>Hot Thread</b>.</info>', 1213876606),
(732, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_hot_thread_posts', '<title>Hot Thread Limit (Posts)</title><info>Define how many threads must be added before a thread can be considered to be a <b>Hot Thread</b>.\r\n\r\nNote that if the setting <setting>bUseHotThreads</setting> is disabled this setting will have no affect on your site.</info>', '<title>Hot Thread Limit (Posts)</title><info>Define how many threads must be added before a thread can be considered to be a <b>Hot Thread</b>.\r\n\r\nNote that if the setting <setting>bUseHotThreads</setting> is disabled this setting will have no affect on your site.</info>', 1213876728),
(733, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_hot_thread_views', '<title>Hot Thread Limit (Views)</title><info>Define how many thread views must be added before a thread can be considered to be a <b>Hot Thread</b>.\r\n\r\nNote that if the setting <setting>bUseHotThreads</setting> is disabled this setting will have no affect on your site.</info>', '<title>Hot Thread Limit (Views)</title><info>Define how many thread views must be added before a thread can be considered to be a <b>Hot Thread</b>.\r\n\r\nNote that if the setting <setting>bUseHotThreads</setting> is disabled this setting will have no affect on your site.</info>', 1213876942),
(734, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_login_module', '<title>User Login Method</title><info>Login method used when a user logs into a site.\r\n\r\n<b>Cookies</b> will store the information we need to keep a user logged in on their end, while a <b>Session</b> will store this information on your server.\r\n\r\nNote that if a user logs into the site with the "Remember Me" box ticked it will automatically use a <b>Cookie</b> to set the users session.</info>', '<title>User Login Method</title><info>Login method used when a user logs into a site.\r\n\r\n<b>Cookies</b> will store the information we need to keep a user logged in on their end, while a <b>Session</b> will store this information on your server.\r\n\r\nNote that if a user logs into the site with the "Remember Me" box ticked it will automatically use a <b>Cookie</b> to set the users session.</info>', 1213877180),
(735, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_active_session', '<title>Active Session</title><info>Define how long a user is displayed as active on the site in minutes. \r\n\r\nIf a user is inactive longer then the specified setting they will be removed from the online session table. When this is done they will no longer appear to be online when other members view their profile. If the user suddenly becomes active after their session expired a new session will automatically be created.</info>', '<title>Active Session</title><info>Define how long a user is displayed as active on the site in minutes. \r\n\r\nIf a user is inactive longer then the specified setting they will be removed from the online session table. When this is done they will no longer appear to be online when other members view their profile. If the user suddenly becomes active after their session expired a new session will automatically be created.</info>', 1213877388),
(736, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_tag_min_display', '<title>Minimum Display</title><info>Define how many tags must be added before they can be displayed to the public.\r\n\r\nHigher this setting if you do want to display a tag cloud with only a few tags.</info>', '<title>Minimum Display</title><info>Define how many tags must be added before they can be displayed to the public.\r\n\r\nHigher this setting if you do want to display a tag cloud with only a few tags.</info>', 1213877642),
(737, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_tag_max_font_size', '<title>Maximum Font Size</title><info>Define the font size for the most added/used tags on the site.</info>', '<title>Maximum Font Size</title><info>Define the font size for the most added/used tags on the site.</info>', 1213877692),
(738, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_tag_min_font_size', '<title>Minimum Font Size</title><info>Define the font size for the least used tags on the site.</info>', '<title>Minimum Font Size</title><info>Define the font size for the least used tags on the site.</info>', 1213877749),
(739, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_tag_cache_tag_cloud', '<title>Cache</title><info>Define how long we should cache tag clouds that are displayed on sections that use them.\r\n\r\nNote that this setting must be defined in minutes.\r\n\r\nIt is important to cache tag clouds as this removes a query to the database that can be rather memory extensive.</info>', '<title>Cache</title><info>Define how long we should cache tag clouds that are displayed on sections that use them.\r\n\r\nNote that this setting must be defined in minutes.\r\n\r\nIt is important to cache tag clouds as this removes a query to the database that can be rather memory extensive.</info>', 1213877937),
(740, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_top_bloggers_display_limit', '<title>Top Bloggers Limit</title><info>Define the limit of how many <b>Top Bloggers</b> can be displayed when viewing the blog section.</info>', '<title>Top Bloggers Limit</title><info>Define the limit of how many <b>Top Bloggers</b> can be displayed when viewing the blog section.</info>', 1213878007),
(741, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_top_bloggers_min_post', '<title>Blog Count for Top Bloggers</title><info>Before a user can be considered to be a <b>Top Blogger</b> they must enter X amount of blog(s) where X is the value of this setting.</info>', '<title>Blog Count for Top Bloggers</title><info>Before a user can be considered to be a <b>Top Blogger</b> they must enter X amount of blog(s) where X is the value of this setting.</info>', 1213878115),
(742, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_cache_top_bloggers', '<title>Cache Top Bloggers</title><info>Set this to <b>True</b> if we should cache the <b>Top Bloggers</b>. It always a good idea to cache such things as there is no need to run an extra query to the database to find out which users are the <b>Top Bloggers</b> as this requires counting all of the blogs added.\r\n\r\nNote that the setting <setting>cache_top_bloggers_limit</setting> controls how long to keep the cache.</info>', '<title>Cache Top Bloggers</title><info>Set this to <b>True</b> if we should cache the <b>Top Bloggers</b>. It always a good idea to cache such things as there is no need to run an extra query to the database to find out which users are the <b>Top Bloggers</b> as this requires counting all of the blogs added.\r\n\r\nNote that the setting <setting>cache_top_bloggers_limit</setting> controls how long to keep the cache.</info>', 1213878273),
(743, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_cache_top_bloggers_limit', '<title>Top Bloggers Cache Time</title><info>Define how long we should keep the cache for the <b>Top Bloggers</b>.\r\n\r\nNote this setting will have not affect if the setting <setting>cache_top_bloggers</setting> is disabled.</info>', '<title>Top Bloggers Cache Time</title><info>Define how long we should keep the cache for the <b>Top Bloggers</b>.\r\n\r\nNote this setting will have not affect if the setting <setting>cache_top_bloggers</setting> is disabled.</info>', 1213878370),
(744, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_display_post_count_in_top_bloggers', '<title>Display Post Count for Top Bloggers</title><info>Set this to <b>True</b> if you would like to display the post count besides the names of each of the <b>Top Bloggers</b>.\r\n\r\nNote that this feature relies on the theme you are using and if the theme is not the default theme provided this might not be displayed.</info>', '<title>Display Post Count for Top Bloggers</title><info>Set this to <b>True</b> if you would like to display the post count besides the names of each of the <b>Top Bloggers</b>.\r\n\r\nNote that this feature relies on the theme you are using and if the theme is not the default theme provided this might not be displayed.</info>', 1213878461),
(745, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_group_archive_handler', '<title>Archive Handler</title><info>Control how the Archive class handles archives that need to be either extracted or created.</info>', '<title>Archive Handler</title><info>Control how the Archive class handles archives that need to be either extracted or created.</info>', 1214047385),
(746, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_unzip_path', '<title>Unzip Path</title><info>Full path to where the binary for <b>unzip</b> is located. \r\n\r\nIf you are unsure you can try to add the following:\r\n[code]\r\nunzip\r\n[/code]\r\n\r\nIf the above does not work you will need to ask your host or run the following command via command line:\r\n[code]\r\nwhereis unzip\r\n[/code]</info>', '<title>Unzip Path</title><info>Full path to where the binary for <b>unzip</b> is located. \r\n\r\nIf you are unsure you can try to add the following:\r\n[code]\r\nunzip\r\n[/code]\r\n\r\nIf the above does not work you will need to ask your host or run the following command via command line:\r\n[code]\r\nwhereis unzip\r\n[/code]</info>', 1214047692),
(747, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_lang_pack_helper', '<title>Language Package Helper</title><info>If enabled this option will add brackets surrounding a phrase, which can be used to identify which phrases have not been added into the core language package. Hard coded phrases will not have brackets.\r\n\r\n\r\n\r\nIf a phrase is hard coded in the source the site will be unable to translate that specific phrase.\r\n\r\nIt is best to use this feature during development or creating of a new language package. \r\n\r\nExample of how a phrase will look once this setting is enabled:\r\n[quote]\r\n{This is a sample}\r\n[/quote]</info>', '<title>Language Package Helper</title><info>If enabled this option will add brackets surrounding a phrase, which can be used to identify which phrases have not been added into the core language package. Hard coded phrases will not have brackets.\r\n\r\n\r\n\r\nIf a phrase is hard coded in the source the site will be unable to translate that specific phrase.\r\n\r\nIt is best to use this feature during development or creating of a new language package. \r\n\r\nExample of how a phrase will look once this setting is enabled:\r\n[quote]\r\n{This is a sample}\r\n[/quote]</info>', 1214050525),
(748, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_group_cron', '<title>Cron</title><info>Control the time-based scheduling service provided.</info>', '<title>Cron</title><info>Control the time-based scheduling service provided.</info>', 1214137439),
(749, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_cron', '<title>Cron Jobs</title><info>Set to <b>True</b> to enable <b>Cron Jobs</b> to actively run in the background of your site.\r\n\r\nIf you have access to setup a crontab this method is preferred but will require access to your server. Once a crontab is setup you can disable this feature.</info>', '<title>Cron Jobs</title><info>Set to <b>True</b> to enable <b>Cron Jobs</b> to actively run in the background of your site.\r\n\r\nIf you have access to setup a crontab this method is preferred but will require access to your server. Once a crontab is setup you can disable this feature.</info>', 1214137712),
(750, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_feed_time_layout', '<title>Time Layout</title><info>Control how old feeds can be by getting feeds that are <b>X</b> minutes, hours, days or months old.\r\n\r\n<b>X</b> is defined by the setting <setting>display_feeds_from</setting>.</info>', '<title>Time Layout</title><info>Control how old feeds can be by getting feeds that are <b>X</b> minutes, hours, days or months old.\r\n\r\n<b>X</b> is defined by the setting <setting>display_feeds_from</setting>.</info>', 1214141052),
(751, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_display_feeds_from', '<title>Time Limit</title><info>This setting is used in conjunction with the setting <setting>feed_time_layout</setting>.\r\n\r\nHere you must define a number which will control how old a news feed can be.</info>', '<title>Time Limit</title><info>This setting is used in conjunction with the setting <setting>feed_time_layout</setting>.\r\n\r\nHere you must define a number which will control how old a news feed can be.</info>', 1214141228),
(752, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_feed_only_friends', '<title>Friends Only</title><info>Set to <b>True</b> if you would like news feed to only be displayed to the user and their friends.</info>', '<title>Friends Only</title><info>Set to <b>True</b> if you would like news feed to only be displayed to the user and their friends.</info>', 1214141288),
(753, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_feed_display_limit', '<title>Display Limit</title><info>Limit how many feeds should be displayed within the main news feed.</info>', '<title>Display Limit</title><info>Limit how many feeds should be displayed within the main news feed.</info>', 1214141651),
(754, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_captcha_code', '<title>Captcha String</title><info>Alphanumeric characters that will be part of the Captcha routine.</info>', '<title>Captcha String</title><info>Alphanumeric characters that will be part of the Captcha routine.</info>', 1214232656),
(755, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_captcha_limit', '<title>Character Limit</title><info>Limit how many characters will be displayed in the Captcha image.</info>', '<title>Character Limit</title><info>Limit how many characters will be displayed in the Captcha image.</info>', 1214232699),
(756, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_captcha_use_font', '<title>Use Font (TTF)</title><info>If enabled and if your server supports the PHP function [link=http://se.php.net/imagettftext]imagettftext[/link] the Captcha routine will use a TTF (True Type Font) to create the text instead of using the default image processing string function.\r\n\r\nThe font that will be used is controlled by the setting <setting>captcha_font</setting>:</info>', '<title>Use Font (TTF)</title><info>If enabled and if your server supports the PHP function [link=http://se.php.net/imagettftext]imagettftext[/link] the Captcha routine will use a TTF (True Type Font) to create the text instead of using the default image processing string function.\r\n\r\nThe font that will be used is controlled by the setting <setting>captcha_font</setting>:</info>', 1214233090),
(757, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_captcha_font', '<title>True Type Font</title><info>Select which TTF (True Type Font) you would like to use for your Captcha image.\r\n\r\nNote the setting <setting>captcha_font</setting> must be enabled in order to use this option.</info>', '<title>True Type Font</title><info>Select which TTF (True Type Font) you would like to use for your Captcha image.\r\n\r\nNote the setting <setting>captcha_font</setting> must be enabled in order to use this option.</info>', 1214233276),
(758, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_default_lang_id', '<title>Default Language ID</title><info>Control the default language ID for the site. Note this setting is handled within the script and in most cases should <b>not</b> be modified.</info>', '<title>Default Language ID</title><info>Control the default language ID for the site. Note this setting is handled within the script and in most cases should <b>not</b> be modified.</info>', 1214236511),
(759, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_default_theme_name', '<title>Default Theme Name</title><info>Default Theme Name</info>', '<title>Default Theme Name</title><info>Default Theme Name</info>', 1214236595),
(760, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_default_style_name', '<title>Default Style Name</title><info>Default Style Name</info>', '<title>Default Style Name</title><info>Default Style Name</info>', 1214236614),
(761, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_default_style_id', '<title>Default Style ID</title><info>Default Style ID</info>', '<title>Default Style ID</title><info>Default Style ID</info>', 1214236630),
(762, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_module_forum', '<title>Default forum module URL</title><info>If the forum module name is different this setting must be updated.</info>', '<title>Default forum module URL</title><info>If the forum module name is different this setting must be updated.</info>', 1214236808),
(763, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_group_admin_control_panel', '<title>Admin Control Panel</title><info>Manage settings for the Admin CP.</info>', '<title>Admin Control Panel</title><info>Manage settings for the Admin CP.</info>', 1214236854),
(764, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_admin_cp', '<title>Admin CP Location</title><info>Location of the Admin CP. Change this to secure your Admin CP.\r\n\r\nBy default the setting is <b>admincp</b> so the final URL will be:\r\n[quote]\r\nhttp://www.yoursite.com/admincp/\r\n[/quote]\r\n\r\nNote the above example is when short URL''s is enabled.</info>', '<title>Admin CP Location</title><info>Location of the Admin CP. Change this to secure your Admin CP.\r\n\r\nBy default the setting is <b>admincp</b> so the final URL will be:\r\n[quote]\r\nhttp://www.yoursite.com/admincp/\r\n[/quote]\r\n\r\nNote the above example is when short URL''s is enabled.</info>', 1214237032),
(765, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_group_general', '<title>General</title><info>Manage general settings.</info>', '<title>General</title><info>Manage general settings.</info>', 1214237167),
(766, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_global_update_time', '<title>Global Time Stamp</title><info>Each module has items that are displayed and use our time stamp settings to display the date the way we would like.\r\n\r\nIf a module does not specify a time stamp setting it will use the default time stamp layout which is controlled with this setting.\r\n\r\nFor a better understanding on how to modify this setting and what the string values stand for you can follow up on the PHP date() function [link=http://se2.php.net/date]here[/link].</info>', '<title>Global Time Stamp</title><info>Each module has items that are displayed and use our time stamp settings to display the date the way we would like.\r\n\r\nIf a module does not specify a time stamp setting it will use the default time stamp layout which is controlled with this setting.\r\n\r\nFor a better understanding on how to modify this setting and what the string values stand for you can follow up on the PHP date() function [link=http://se2.php.net/date]here[/link].</info>', 1214237553),
(767, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_group_time_stamps', '<title>Time Stamps</title><info>Control global and module time stamps.</info>', '<title>Time Stamps</title><info>Control global and module time stamps.</info>', 1214312574),
(768, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_group_server_settings', '<title>Server Settings</title><info>Manage server settings and optimization options.</info>', '<title>Server Settings</title><info>Manage server settings and optimization options.</info>', 1214312832),
(769, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_use_gzip', '<title>GZIP HTML Output</title><info>Selecting <b>True</b> will enable the option to GZIP compress the HTML output of pages, thus reducing bandwidth requirements. This will be only used on clients that support it, and are HTTP 1.1 compliant. There will be a small performance overhead.\r\n\r\nThis feature requires the ZLIB library.\r\n\r\nIf you are already using <b>mod_gzip</b> or <b>mod_deflate</b> on your server, do not enable this option.</info>', '<title>GZIP HTML Output</title><info>Selecting <b>True</b> will enable the option to GZIP compress the HTML output of pages, thus reducing bandwidth requirements. This will be only used on clients that support it, and are HTTP 1.1 compliant. There will be a small performance overhead.\r\n\r\nThis feature requires the ZLIB library.\r\n\r\nIf you are already using <b>mod_gzip</b> or <b>mod_deflate</b> on your server, do not enable this option.</info>', 1214313174),
(770, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_gzip_level', '<title>GZIP Compression Level</title><info>Set the level of GZIP compression that will take place on the output. 0=none; 9=max.\r\n\r\nWe strongly recommend that you use level 1 for optimum results.</info>', '<title>GZIP Compression Level</title><info>Set the level of GZIP compression that will take place on the output. 0=none; 9=max.\r\n\r\nWe strongly recommend that you use level 1 for optimum results.</info>', 1214313244),
(771, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_title_delim', '<title>Site Title Delimiter</title><info>This value will be used as the delimiter to separate titles being added for each page on the site.</info>', '<title>Site Title Delimiter</title><info>This value will be used as the delimiter to separate titles being added for each page on the site.</info>', 1214313635),
(772, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_site_title', '<title>Site Name</title><info>Name of your site. This will appear on every page.</info>', '<title>Site Name</title><info>Name of your site. This will appear on every page.</info>', 1214313887),
(773, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_branding', '<title>phpFox Branding Removal</title><info>Set to <b>True</b> to remove phpFox branding.</info>', '<title>phpFox Branding Removal</title><info>Set to <b>True</b> to remove phpFox branding.</info>', 1214314014),
(774, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_ip_check', '<title>Session IP Octet Length Check</title><info>Select the subnet mask which reflects the level of checking you wish to run against IP addresses when a session is being fetched.\r\n\r\nThis is useful if you have a large number of users who are behind transparent proxies and have an IP address that can change randomly between request such as AOL.\r\n\r\nThe more this is decreased the greater the security risk from session hijacking.</info>', '<title>Session IP Octet Length Check</title><info>Select the subnet mask which reflects the level of checking you wish to run against IP addresses when a session is being fetched.\r\n\r\nThis is useful if you have a large number of users who are behind transparent proxies and have an IP address that can change randomly between request such as AOL.\r\n\r\nThe more this is decreased the greater the security risk from session hijacking.</info>', 1214314158),
(775, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_session_prefix', '<title>Cookie Prefix</title><info>Prefix for cookies and PHP sessions being set by the script. \r\n\r\n<b>Warning</b>: This value can only contain alphanumeric characters (eg. a-zA-Z0-9)\r\n\r\nNote that everyone will be forced to login again for security reasons.</info>', '<title>Cookie Prefix</title><info>Prefix for cookies and PHP sessions being set by the script. \r\n\r\n<b>Warning</b>: This value can only contain alphanumeric characters (eg. a-zA-Z0-9)\r\n\r\nNote that everyone will be forced to login again for security reasons.</info>', 1214314437),
(776, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_keywords', '<title>Meta Keywords</title><info>Enter the meta keywords for all pages. These are used by search engines to index your pages with more relevance.\r\n\r\nNote that certain modules or pages have their own meta keyword settings and if those are set they will override this setting.</info>', '<title>Meta Keywords</title><info>Enter the meta keywords for all pages. These are used by search engines to index your pages with more relevance.\r\n\r\nNote that certain modules or pages have their own meta keyword settings and if those are set they will override this setting.</info>', 1214314561),
(777, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_description', '<title>Meta Description</title><info>Enter the meta description for all pages. This is used by search engines to index your pages more relevantly.\r\n\r\nNote that certain modules or pages have their own meta keyword settings and if those are set they will override this setting.</info>', '<title>Meta Description</title><info>Enter the meta description for all pages. This is used by search engines to index your pages more relevantly.\r\n\r\nNote that certain modules or pages have their own meta keyword settings and if those are set they will override this setting.</info>', 1214314637),
(778, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_tar_path', '<title>Tar Path</title><info>Full path to where the binary for tar is located.\r\n\r\nIf you are unsure you can try to add the following:\r\n[code]\r\ntar\r\n[/code]\r\n\r\nIf the above does not work you will need to ask your host or run the following command via command line:\r\n[code]\r\nwhereis tar\r\n[/code]</info>', '<title>Tar Path</title><info>Full path to where the binary for tar is located.\r\n\r\nIf you are unsure you can try to add the following:\r\n[code]\r\ntar\r\n[/code]\r\n\r\nIf the above does not work you will need to ask your host or run the following command via command line:\r\n[code]\r\nwhereis tar\r\n[/code]</info>', 1214323414),
(779, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_csrf_protection_level', '<title>CSRF Protection Level</title><info>Select the Cross Site Forgery Request (CSRF) prevention level you want on your site.\r\n\r\n<b>Low</b>\r\nMinimal prevention for CSRF attacks.\r\n\r\n<b>Medium</b>\r\nEach user will have a unique token ID which will be static as long as they use the same browser for that session. \r\n\r\n<b>High</b>\r\nEach user will have a unique token ID which will be changed on each page they visit thus giving them a random ID on each page refresh. This method offers full protection against CSRF attacks, however since the token is random the user can only browse your site with one browser window. If they would for example use a browser that supports tabs and would use a 2nd tab and would then attempt to submit a form they might get a CSRF attack error message since their last token was from the previous tab they had open.</info>', '<title>CSRF Protection Level</title><info>Select the Cross Site Forgery Request (CSRF) prevention level you want on your site.\r\n\r\n<b>Low</b>\r\nMinimal prevention for CSRF attacks.\r\n\r\n<b>Medium</b>\r\nEach user will have a unique token ID which will be static as long as they use the same browser for that session. \r\n\r\n<b>High</b>\r\nEach user will have a unique token ID which will be changed on each page they visit thus giving them a random ID on each page refresh. This method offers full protection against CSRF attacks, however since the token is random the user can only browse your site with one browser window. If they would for example use a browser that supports tabs and would use a 2nd tab and would then attempt to submit a form they might get a CSRF attack error message since their last token was from the previous tab they had open.</info>', 1214854966),
(780, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_is_personal_site', '<title>Personal Site</title><info>If set to <b>Yes</b> the site will be treated as your personal web site and items such as blogs will only be viewable from the public area and not from personal profiles.\r\n\r\nOnly enable this feature if you do not plan on having a social networking community and only plan to add your personal items.</info>', '<title>Personal Site</title><info>If set to <b>Yes</b> the site will be treated as your personal web site and items such as blogs will only be viewable from the public area and not from personal profiles.\r\n\r\nOnly enable this feature if you do not plan on having a social networking community and only plan to add your personal items.</info>', 1215181158),
(781, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_module_core', '<title>Core Module</title><info>Specify the core module. Changing this could cause severe problems on the site.</info>', '<title>Core Module</title><info>Specify the core module. Changing this could cause severe problems on the site.</info>', 1215411477),
(782, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_build_file_dir', '<title>Build Directories</title><info>If set to <b>True</b> and items are added to the <b>file/</b> directory they will be placed in separate folders for organization and security purposes. The <b>file/</b> folder is used to store cached data or items uploaded by users.\r\n\r\nYou can define how the directories will be built using the setting <setting>build_format</setting>.\r\n\r\nBy default directories will be built using the <b>Year/Month</b> format. If an image would be uploaded on January 1st 2008 it would be placed in the folder: file/pic/photo/2008/01/\r\n\r\n<b>Notice:</b> If you have PHP [link="http://se.php.net/features.safe-mode"]Safe Mode[/link] enabled this feature might not work unless the <b>file/</b> folder belongs to the same UID (owner) as the script.</info>', '<title>Build Directories</title><info>If set to <b>True</b> and items are added to the <b>file/</b> directory they will be placed in separate folders for organization and security purposes. The <b>file/</b> folder is used to store cached data or items uploaded by users.\r\n\r\nYou can define how the directories will be built using the setting <setting>build_format</setting>.\r\n\r\nBy default directories will be built using the <b>Year/Month</b> format. If an image would be uploaded on January 1st 2008 it would be placed in the folder: file/pic/photo/2008/01/\r\n\r\n<b>Notice:</b> If you have PHP [link="http://se.php.net/features.safe-mode"]Safe Mode[/link] enabled this feature might not work unless the <b>file/</b> folder belongs to the same UID (owner) as the script.</info>', 1215412887),
(783, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_build_format', '<title>Build Format</title><info>This setting controls how the setting <setting>build_format</setting> functions.\r\n\r\nThis setting uses the PHP [link="http://se2.php.net/date"]date()[/link] function to control how directories are created within the <b>file/</b> folder.\r\n\r\nBy default we use <b>Y/m</b>. <b>Y</b> stands for a full numeric representation of a year, 4 digits (Eg. 2008). <b>m</b> stands for a numeric representation of a month, with leading zeros (Eg. 01).\r\n\r\nFor more information regarding this setting you may follow up on the PHP function [link="http://se2.php.net/date"]here[/link].</info>', '<title>Build Format</title><info>This setting controls how the setting <setting>build_format</setting> functions.\r\n\r\nThis setting uses the PHP [link="http://se2.php.net/date"]date()[/link] function to control how directories are created within the <b>file/</b> folder.\r\n\r\nBy default we use <b>Y/m</b>. <b>Y</b> stands for a full numeric representation of a year, 4 digits (Eg. 2008). <b>m</b> stands for a numeric representation of a month, with leading zeros (Eg. 01).\r\n\r\nFor more information regarding this setting you may follow up on the PHP function [link="http://se2.php.net/date"]here[/link].</info>', 1215414328),
(784, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_blog_time_stamp', '<title>Blog</title><info>Controls time stamps for blog entries.\r\n\r\nIf using the default setting and the default template the time stamp will appear under each blog title and will look similar to:\r\n[quote]\r\nPosted June 22, 2008 by Raymond Benc\r\n[/quote]</info>', '<title>Blog</title><info>Controls time stamps for blog entries.\r\n\r\nIf using the default setting and the default template the time stamp will appear under each blog title and will look similar to:\r\n[quote]\r\nPosted June 22, 2008 by Raymond Benc\r\n[/quote]</info>', 1215414980),
(785, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_comment_time_stamp', '<title>Comments</title><info>Controls time stamps for each comment being posted on the site.\r\n\r\nIf using the default setting and template the time stamp will appear under the posters user name\r\n[quote]\r\nRaymond Benc wrote\r\n[/quote]\r\nand will be similar to:\r\n[quote]\r\nJune 22, 2008 \r\n[/quote]</info>', '<title>Comments</title><info>Controls time stamps for each comment being posted on the site.\r\n\r\nIf using the default setting and template the time stamp will appear under the posters user name\r\n[quote]\r\nRaymond Benc wrote\r\n[/quote]\r\nand will be similar to:\r\n[quote]\r\nJune 22, 2008 \r\n[/quote]</info>', 1215415183),
(786, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_forum_time_stamp', '<title>Forum</title><info>Default forum time stamp</info>', '<title>Forum</title><info>Default forum time stamp</info>', 1215415254),
(787, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_forum_post_time_stamp', '<title>Forum Post</title><info>Default forum time stamp</info>', '<title>Forum Post</title><info>Default forum time stamp</info>', 1215415278);
INSERT INTO `themsg_language_phrase` (`phrase_id`, `language_id`, `module_id`, `product_id`, `version_id`, `var_name`, `text`, `text_default`, `added`) VALUES
(788, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_forum_post_today_time_stamp', '<title>Forum Post (Today)</title><info>More info coming...</info>', '<title>Forum Post (Today)</title><info>More info coming...</info>', 1215415308),
(789, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_forum_post_yesterday_time_stamp', '<title>Forum Post (Yesterday)</title><info>More info coming...</info>', '<title>Forum Post (Yesterday)</title><info>More info coming...</info>', 1215415343),
(790, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_forum_post_join_date', '<title>Forum Post User Join</title><info>More info coming...</info>', '<title>Forum Post User Join</title><info>More info coming...</info>', 1215415367),
(791, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_zip_path', '<title>Zip Path</title><info>Full path to where the binary for <b>zip</b> is located.\r\n\r\nIf you are unsure you can try to add the following:\r\n[code]\r\nzip\r\n[/code]\r\n\r\nIf the above does not work you will need to ask your host or run the following command via command line:\r\n[code]\r\nwhereis zip\r\n[/code]</info>', '<title>Zip Path</title><info>Full path to where the binary for <b>zip</b> is located.\r\n\r\nIf you are unsure you can try to add the following:\r\n[code]\r\nzip\r\n[/code]\r\n\r\nIf the above does not work you will need to ask your host or run the following command via command line:\r\n[code]\r\nwhereis zip\r\n[/code]</info>', 1215418009),
(792, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_cache_phrases', '<title>Page Cache</title><info>If set to <b>Yes</b>, phrases from language packages will be cached based on the page being viewed instead of the conventional method which caches all phrases and splits them up into the modules they belong to. \r\n\r\nThe module cache method is good during your development period, however once your site is live and you don''t plan to make any changes to the language package enabling this setting to cache phrases on a per page basis is a good idea.\r\n\r\nThis will in return save the total memory consumption as phrases are cached into memory (depending on your cache method) and loading several modules on one page can be a waste when you may only need 20 phrases from 3 different modules.</info>', '<title>Page Cache</title><info>If set to <b>Yes</b>, phrases from language packages will be cached based on the page being viewed instead of the conventional method which caches all phrases and splits them up into the modules they belong to. \r\n\r\nThe module cache method is good during your development period, however once your site is live and you don''t plan to make any changes to the language package enabling this setting to cache phrases on a per page basis is a good idea.\r\n\r\nThis will in return save the total memory consumption as phrases are cached into memory (depending on your cache method) and loading several modules on one page can be a waste when you may only need 20 phrases from 3 different modules.</info>', 1216087500),
(793, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_site_copyright', '<title>Copyright</title><info>Add your sites copyright.</info>', '<title>Copyright</title><info>Add your sites copyright.</info>', 1217035523),
(794, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_comment_is_threaded', '<title>Thread Display</title><info>If set to <b>True</b> comments will be displayed in a thread format allowing users to reply to specific comments instead of the general item they are commenting on.</info>', '<title>Thread Display</title><info>If set to <b>True</b> comments will be displayed in a thread format allowing users to reply to specific comments instead of the general item they are commenting on.</info>', 1217198416),
(795, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_group_forms', '<title>Forms</title><info>Manage settings for general forms being used on the site.</info>', '<title>Forms</title><info>Manage settings for general forms being used on the site.</info>', 1217804478),
(796, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_display_required', '<title>Display Required Fields</title><info>When set to <b>True</b> forms that have both optional and "required" fields will have a asterisk (depending on what is set for the setting <setting>required_symbol</setting>).</info>', '<title>Display Required Fields</title><info>When set to <b>True</b> forms that have both optional and "required" fields will have a asterisk (depending on what is set for the setting <setting>required_symbol</setting>).</info>', 1217804762),
(797, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_required_symbol', '<title>Required Field Symbol</title><info>On forms that have fields that are required we add a symbol to distinguish which fields are required and which are not. Change this setting will change that symbol which by default is an asterisk.</info>', '<title>Required Field Symbol</title><info>On forms that have fields that are required we add a symbol to distinguish which fields are required and which are not. Change this setting will change that symbol which by default is an asterisk.</info>', 1217804932),
(798, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_blog_display_user_post_count', '<title>Display Post Count for Categories (Personal)</title><info>If set to <b>True</b> we will display a users post count for a specific category. This will be displayed on their profile, blog and when browsing their own blogs.\r\n\r\nNotice: This will add an extra strain to your server if set to <b>True</b>.</info>', '<title>Display Post Count for Categories (Personal)</title><info>If set to <b>True</b> we will display a users post count for a specific category. This will be displayed on their profile, blog and when browsing their own blogs.\r\n\r\nNotice: This will add an extra strain to your server if set to <b>True</b>.</info>', 1217808470),
(799, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_default_time_zone_offset', '<title>Default Time Zone</title><info>Select the default time zone for guests and new users.</info>', '<title>Default Time Zone</title><info>Select the default time zone for guests and new users.</info>', 1218452027),
(800, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_login_type', '<title>User Login Method</title><info>Select the method you would like your users to use when logging into the site.\r\n\r\n<b>user_name</b>\r\nMust use their user name.\r\n\r\n<b>email</b>\r\nMust use their email.\r\n\r\n<b>both</b>\r\nCan use either email or user name.</info>', '<title>User Login Method</title><info>Select the method you would like your users to use when logging into the site.\r\n\r\n<b>user_name</b>\r\nMust use their user name.\r\n\r\n<b>email</b>\r\nMust use their email.\r\n\r\n<b>both</b>\r\nCan use either email or user name.</info>', 1218457359),
(801, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_redirect_after_login', '<title>URL Redirect After Login</title><info>After a user has logged in and they have not requested a page to visit you can set a default redirection URL, which will send them to this specific page right after they login. \r\n\r\nIf you add an external link be sure to add "http://" (without quotes) otherwise the URL will be treated as an internal link.</info>', '<title>URL Redirect After Login</title><info>After a user has logged in and they have not requested a page to visit you can set a default redirection URL, which will send them to this specific page right after they login. \r\n\r\nIf you add an external link be sure to add "http://" (without quotes) otherwise the URL will be treated as an internal link.</info>', 1218465807),
(802, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_profile_time_stamps', '<title>Profile</title><info>Profile time stamps</info>', '<title>Profile</title><info>Profile time stamps</info>', 1219668321),
(803, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_user_pic_sizes', '<title>User Pic Sizes</title><info>User Pic Sizes</info>', '<title>User Pic Sizes</title><info>User Pic Sizes</info>', 1219836551),
(804, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_mail_time_stamp', '<title>Mail</title><info>Mail</info>', '<title>Mail</title><info>Mail</info>', 1220427478),
(805, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_profile_use_id', '<title>Profile User ID Connection</title><info>Set to <b>True</b> if you would like to have user profiles connected via their user ID#. Set to <b>False</b> if you would like to have user profiles connected via their user name. \r\n\r\nNote if you connect via their user ID# you will allow your members the ability to use non-supported characters which are not allowed if connecting a profile with their user name.\r\n\r\n<b>Warning:</b> This action cannot be reversed.\r\nThis setting may lock users out if you force log in by their user names\r\n</info>', '<title>Profile User ID Connection</title><info>Set to <b>True</b> if you would like to have user profiles connected via their user ID#. Set to <b>False</b> if you would like to have user profiles connected via their user name. \r\n\r\nNote if you connect via their user ID# you will allow your members the ability to use non-supported characters which are not allowed if connecting a profile with their user name.\r\n\r\n<b>Warning:</b> This action cannot be reversed.\r\nThis setting may lock users out if you force log in by their user names\r\n</info>', 1221724040),
(806, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_group_sample_2', '<title>Sample 2</title><info>Sample 2</info>', '<title>Sample 2</title><info>Sample 2</info>', 1221824783),
(807, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_bsample', '<title>This is a test</title><info>Yet another test...</info>', '<title>This is a test</title><info>Yet another test...</info>', 1221824814),
(808, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_captcha_on_signup', '<title>Captcha on Registration</title><info>Enable this option to add a captcha routine to the registration process. This will help against spam.</info>', '<title>Captcha on Registration</title><info>Enable this option to add a captcha routine to the registration process. This will help against spam.</info>', 1221831949),
