(885, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_use_dnscheck', '<title>Use DNSCheck in email validation</title><info>http://php.net/checkdnsrr\r\n\r\nThis value tells if the script should validate the email addresses using checkdnsrr.\r\n\r\nThis function may not be available in some windows default installations. However even if this setting is enabled if the function does not exist the site will not fail, it will only skip that part of the validation.\r\n\r\nThere is some undocumented (but technically possible) slow down on using this feature, so while it adds extra security to your site it could also become a bottleneck. Use carefully.</info>', '<title>Use DNSCheck in email validation</title><info>http://php.net/checkdnsrr\r\n\r\nThis value tells if the script should validate the email addresses using checkdnsrr.\r\n\r\nThis function may not be available in some windows default installations. However even if this setting is enabled if the function does not exist the site will not fail, it will only skip that part of the validation.\r\n\r\nThere is some undocumented (but technically possible) slow down on using this feature, so while it adds extra security to your site it could also become a bottleneck. Use carefully.</info>', 1236199706),
(886, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_group_debug', '<title>Debug</title><info>Debug Settings</info>', '<title>Debug</title><info>Debug Settings</info>', 1237059507),
(887, 'en', 'core', 'phpfox', '2.0.0alpha1', 'setting_admin_debug_mode', '<title>Debug Level</title><info>Control the debug output at the bottom for the site.\r\n\r\n<b>Level Information</b>\r\n\r\n<b>Level 0</b> = Debug is disabled.\r\n\r\n<b>Level 1</b> = Enables PHP error reporting, page generation times and query count.\r\n\r\n<b>Level 2</b> = Includes <i>Level 1</i>, server usage, session and cookie information.\r\n\r\n<b>Level 3</b> = Includes <i>Level 1</i>, <i>Level 2</i> and SQL queries.</info>', '<title>Debug Level</title><info>Control the debug output at the bottom for the site.\r\n\r\n<b>Level Information</b>\r\n\r\n<b>Level 0</b> = Debug is disabled.\r\n\r\n<b>Level 1</b> = Enables PHP error reporting, page generation times and query count.\r\n\r\n<b>Level 2</b> = Includes <i>Level 1</i>, server usage, session and cookie information.\r\n\r\n<b>Level 3</b> = Includes <i>Level 1</i>, <i>Level 2</i> and SQL queries.</info>', 1237059838),
(888, 'en', 'core', 'phpfox', '2.0.0alpha3', 'setting_replace_url_with_links', '<title>Replace URL with Links</title><info>Set to <b>True</b> if you would like to automatically replace URL strings to anchor links.</info>', '<title>Replace URL with Links</title><info>Set to <b>True</b> if you would like to automatically replace URL strings to anchor links.</info>', 1239104515),
(889, 'en', 'core', 'phpfox', '2.0.0alpha3', 'setting_shorten_parsed_url_links', '<title>Shorten Parsed URL Links</title><info>If the option to parse URL strings to links is enabled then you can control how long the URL string should be before you shorten it.\r\n\r\n<b>Note:</b> Set to <b>0</b> to have no limit.</info>', '<title>Shorten Parsed URL Links</title><info>If the option to parse URL strings to links is enabled then you can control how long the URL string should be before you shorten it.\r\n\r\n<b>Note:</b> Set to <b>0</b> to have no limit.</info>', 1239104765),
