(901, 'en', 'core', 'phpfox', '2.0.0beta4', 'setting_cache_site_stats', '<title>Cache Site Stats</title><info>Set to <b>True</b> if site stats should be cached.\r\n\r\n<b>Notice:</b> It is highly advised to cache site stats as it requires a large set of queries to the database across numerous tables.</info>', '<title>Cache Site Stats</title><info>Set to <b>True</b> if site stats should be cached.\r\n\r\n<b>Notice:</b> It is highly advised to cache site stats as it requires a large set of queries to the database across numerous tables.</info>', 1245149101),
