(912, 'en', 'core', 'phpfox', '2.0.0rc1', 'setting_item_view_area', '<title>Item Location</title><info>Select <b>public</b> if you would like all items to be displayed within a public section or select <b>profile</b> to have items displayed on a users profile. \r\n\r\nIt is advised to select this option once as this greatly effects how search engines pick up pages on the site.</info>', '<title>Item Location</title><info>Select <b>public</b> if you would like all items to be displayed within a public section or select <b>profile</b> to have items displayed on a users profile. \r\n\r\nIt is advised to select this option once as this greatly effects how search engines pick up pages on the site.</info>', 1248967239),
(913, 'en', 'core', 'phpfox', '2.0.0rc1', 'setting_ftp_dir_path', '<title>FTP Directory Path</title><info>Supply the full path to the scripts root directory.\r\n\r\nIf you are unsure on the full path, you can click <a href="#" onclick="tb_show(''FTP Path Search'', $.ajaxBox(''core.ftpPathSearch'', ''height=410&width=700'')); return false;">here</a> for help on finding the correct full path.</info>', '<title>FTP Directory Path</title><info>Supply the full path to the scripts root directory.\r\n\r\nIf you are unsure on the full path, you can click <a href="#" onclick="tb_show(''FTP Path Search'', $.ajaxBox(''core.ftpPathSearch'', ''height=410&width=700'')); return false;">here</a> for help on finding the correct full path.</info>', 1249534880),
