(941, 'en', 'core', 'phpfox', '2.0.0rc1', 'setting_akismet_password', '<title>Akismet API Key</title><info><a href="http://akismet.com/">Akismet</a>  API key is a private key Akismet provides when you register for an account with them.</info>', '<title>Akismet API Key</title><info><a href="http://akismet.com/">Akismet</a>  API key is a private key Akismet provides when you register for an account with them.</info>', 1251183407),
(942, 'en', 'core', 'phpfox', '2.0.0rc1', 'user_setting_is_spam_free', 'Set to <b>True</b> if this user group should never be checked for spamming.', 'Set to <b>True</b> if this user group should never be checked for spamming.', 1251184321),
(943, 'en', 'core', 'phpfox', '2.0.0rc1', 'setting_auto_deny_items', '<title>SPAM Count</title><info>Define how many items a user can attempt to SPAM before anything they add will not be checked as we will consider that it is SPAM.</info>', '<title>SPAM Count</title><info>Define how many items a user can attempt to SPAM before anything they add will not be checked as we will consider that it is SPAM.</info>', 1251199652),
(944, 'en', 'core', 'phpfox', '2.0.0rc1', 'setting_auto_ban_spammer', '<title>Auto Ban Spammers</title><info>Define how many times a user can SPAM before they are automatically banned.\r\n\r\n<b>Notice:</b> Set this to "0" (without quotes) to disable this setting.</info>', '<title>Auto Ban Spammers</title><info>Define how many times a user can SPAM before they are automatically banned.\r\n\r\n<b>Notice:</b> Set this to "0" (without quotes) to disable this setting.</info>', 1251200209),
(945, 'en', 'core', 'phpfox', '2.0.0rc1', 'setting_warn_on_external_links', '<title>External Links Warning</title><info>Warn users when they have clicked on a link that will direct them to another site.</info>', '<title>External Links Warning</title><info>Warn users when they have clicked on a link that will direct them to another site.</info>', 1251207145),
(946, 'en', 'core', 'phpfox', '2.0.0rc1', 'setting_disable_all_external_urls', '<title>Disable All External URL''s</title><info>Enable this feature to remove all external links from the site. \r\n\r\n<b>Notice:</b> Sites added to the "URL White List" will be allowed.</info>', '<title>Disable All External URL''s</title><info>Enable this feature to remove all external links from the site. \r\n\r\n<b>Notice:</b> Sites added to the "URL White List" will be allowed.</info>', 1251275581),
(947, 'en', 'core', 'phpfox', '2.0.0rc1', 'setting_url_spam_white_list', '<title>URL White List</title><info>Add sites that you want to allow in external links.</info>', '<title>URL White List</title><info>Add sites that you want to allow in external links.</info>', 1251275716),
(948, 'en', 'core', 'phpfox', '2.0.0rc1', 'setting_disable_all_external_emails', '<title>Disable All External Emails</title><info>Enable this feature to remove all external emails from the site.\r\n\r\nNotice: Sites added to the "Email White List" will be allowed.</info>', '<title>Disable All External Emails</title><info>Enable this feature to remove all external emails from the site.\r\n\r\nNotice: Sites added to the "Email White List" will be allowed.</info>', 1251276234),
(949, 'en', 'core', 'phpfox', '2.0.0rc1', 'setting_email_white_list', '<title>Email White List</title><info>Add sites that you want to allow in external emails.</info>', '<title>Email White List</title><info>Add sites that you want to allow in external emails.</info>', 1251276292),
