(953, 'en', 'core', 'phpfox', '2.0.0rc1', 'setting_redirect_guest_on_same_page', '<title>Same Page Redirection After Login/Registration</title><info>Enable this option to redirect guests to the same page they were visiting after they have logged into or registered.</info>', '<title>Same Page Redirection After Login/Registration</title><info>Enable this option to redirect guests to the same page they were visiting after they have logged into or registered.</info>', 1251815780),
(954, 'en', 'core', 'phpfox', '2.0.0rc1', 'setting_meta_description_profile', '<title>Meta Description Profile</title><info>This is the meta description provided on a users profile that is included with their personal information. It is advised for this to not be too long in order to leave room for the users personal information.</info>', '<title>Meta Description Profile</title><info>This is the meta description provided on a users profile that is included with their personal information. It is advised for this to not be too long in order to leave room for the users personal information.</info>', 1252056488),
