(1066, 'en', 'core', 'phpfox', '2.0.0rc4', 'setting_can_move_on_a_y_and_x_axis', '<title>Drag/Drop Blocks</title><info>Set this setting to <b>True</b> if you want to allow users to move blocks on a Y or X axis within areas where they can move blocks (eg. Their own profile). By default we only allow users to move blocks on a Y axis and allowing users to move blocks anywhere will give them the freedom but can cause your site design to be destroyed.</info>', '<title>Drag/Drop Blocks</title><info>Set this setting to <b>True</b> if you want to allow users to move blocks on a Y or X axis within areas where they can move blocks (eg. Their own profile). By default we only allow users to move blocks on a Y axis and allowing users to move blocks anywhere will give them the freedom but can cause your site design to be destroyed.</info>', 1256500257),
