(1069, 'en', 'core', 'phpfox', '2.0.0rc4', 'setting_resize_images', '<title>Resize Images</title><info>If you allow HTML on the site and users attempt to add images you can enable this option to set a maximum width/height in certain areas (eg. General Comments & News Feed).\r\n\r\n<b>Note:</b> If enabled this will add an extra overhead to the script.</info>', '<title>Resize Images</title><info>If you allow HTML on the site and users attempt to add images you can enable this option to set a maximum width/height in certain areas (eg. General Comments & News Feed).\r\n\r\n<b>Note:</b> If enabled this will add an extra overhead to the script.</info>', 1256639414),
