(1102, 'en', 'core', 'phpfox', '2.0.0rc11', 'setting_no_more_ie6', '<title>Detect IE6</title><info>With this feature enabled it will guide those using IE6 to upgrade to a supported browser.\r\n\r\nThis feature is powered by <a href="http://www.ie6nomore.com/" target="_blank">IE6 No More</a>\r\n\r\n<b>Note:</b> The themes we provide by default require IE7 or higher, however other themes could work fine with IE6 as this comes down to the theme you have installed.</info>', '<title>Detect IE6</title><info>With this feature enabled it will guide those using IE6 to upgrade to a supported browser.\r\n\r\nThis feature is powered by <a href="http://www.ie6nomore.com/" target="_blank">IE6 No More</a>\r\n\r\n<b>Note:</b> The themes we provide by default require IE7 or higher, however other themes could work fine with IE6 as this comes down to the theme you have installed.</info>', 1260114410),
