(1112, 'en', 'core', 'phpfox', '2.0.0rc11', 'setting_resize_embed_video', '<title>Resize Embedded Videos</title><info>Enable this feature to resize embedded videos to fit your sites default theme in areas where it is designed to fix flash videos (eg. users profile).\r\n\r\nNote that enabling this feature will be an extra overhead.\r\n\r\nUse this feature with caution as it is  experimental.\r\n</info>', '<title>Resize Embedded Videos</title><info>Enable this feature to resize embedded videos to fit your sites default theme in areas where it is designed to fix flash videos (eg. users profile).\r\n\r\nNote that enabling this feature will be an extra overhead.\r\n\r\nUse this feature with caution as it is  experimental.\r\n</info>', 1260137802),
(1113, 'en', 'core', 'phpfox', '2.0.0rc11', 'translate', 'Translate', 'Translate', 1260209538),
(1114, 'en', 'core', 'phpfox', '2.0.0rc12', 'setting_footer_watch_time_stamp', '<title>Footer Bar Time Stamp</title><info>Footer Bar Time Stamp</info>', '<title>Footer Bar Time Stamp</title><info>Footer Bar Time Stamp</info>', 1260824135),
(1115, 'en', 'core', 'phpfox', '2.0.0rc12', 'setting_categories_to_show_at_first', '<title>How many subcategories to show at first</title><info>This setting tells how many subcategories are to be shown at first. If the list of subcategories is longer than this value the extra ones will be hidden and a "View More" option will be shown instead, allowing the user to display the hidden subcategories.\r\n\r\na "View Less" option will be available to provide the full "accordion" effect.\r\n\r\nIf you set it to zero ("0" without quotes) it will hide every subcategory and a plus sign will show next to the category name, clicking the plus sign will show that category''s subcategories.\r\n</info>', '<title>How many subcategories to show at first</title><info>This setting tells how many subcategories are to be shown at first. If the list of subcategories is longer than this value the extra ones will be hidden and a "View More" option will be shown instead, allowing the user to display the hidden subcategories.\r\n\r\na "View Less" option will be available to provide the full "accordion" effect.\r\n\r\nIf you set it to zero ("0" without quotes) it will hide every subcategory and a plus sign will show next to the category name, clicking the plus sign will show that category''s subcategories.\r\n</info>', 1260886987),
