(1132, 'en', 'core', 'phpfox', '2.0.5', 'setting_exchange_rate_api_key', '<title>Exchange Rate API</title><info>In order to get the latest exchange rates for the currencies being used we need to connect to a 3rd party website. To sign up for a free API key go <a href="http://www.exchangerate-api.com/api-key">here</a>.</info>', '<title>Exchange Rate API</title><info>In order to get the latest exchange rates for the currencies being used we need to connect to a 3rd party website. To sign up for a free API key go <a href="http://www.exchangerate-api.com/api-key">here</a>.</info>', 1272025266),
