(1136, 'en', 'core', 'phpfox', '2.0.5', 'setting_amazon_bucket', '<title>Amazon Bucket Name</title><info>This will automatically be created by the script. Leave this setting unless you want to manually create a bucket on Amazon.</info>', '<title>Amazon Bucket Name</title><info>This will automatically be created by the script. Leave this setting unless you want to manually create a bucket on Amazon.</info>', 1272361799),
