(1138, 'en', 'core', 'phpfox', '2.0.5', 'setting_allow_cdn', '<title>Enable CDN (Beta)</title><info>Set this to "True" if you want to use CDN. Note that this feature is still in "Beta".</info>', '<title>Enable CDN (Beta)</title><info>Set this to "True" if you want to use CDN. Note that this feature is still in "Beta".</info>', 1272362370),
(1139, 'en', 'core', 'phpfox', '2.0.5', 'money_field_only_accepts_numbers_and_point', 'The money fields can only have numbers and a point.\r\nValid examples:\r\n12.43\r\n15\r\n0.65', 'The money fields can only have numbers and a point.\r\nValid examples:\r\n12.43\r\n15\r\n0.65', 1271338945),
(1140, 'en', 'core', 'phpfox', '2.0.5', 'only_one_point_is_allowed', 'In money fields only one point is allowed, valid examples:\r\n23.12\r\n19.54\r\n30', 'In money fields only one point is allowed, valid examples:\r\n23.12\r\n19.54\r\n30', 1271339014),
(1141, 'en', 'core', 'phpfox', '2.0.5', 'money_fields_are_required', 'If a money field is set, the others are required. You can leave them all empty or none.', 'If a money field is set, the others are required. You can leave them all empty or none.', 1271339939),
(1142, 'en', 'core', 'phpfox', '2.0.5', 'setting_cdn_cname', '<title>CDN URL (Optional)</title><info>If your CDN provider allows you to create a CNAME record you can add the domain here. Example: (http://cdn.yoursite.com/)</info>', '<title>CDN URL (Optional)</title><info>If your CDN provider allows you to create a CNAME record you can add the domain here. Example: (http://cdn.yoursite.com/)</info>', 1273008398),
(1143, 'en', 'core', 'phpfox', '2.0.5dev1', 'setting_force_https_secure_pages', '<title>Secure Pages with HTTPS</title><info>If your server has support for HTTPS you can enable this feature to secure certain pages like the login, registration and account setting pages.</info>', '<title>Secure Pages with HTTPS</title><info>If your server has support for HTTPS you can enable this feature to secure certain pages like the login, registration and account setting pages.</info>', 1274840652),
(1144, 'en', 'core', 'phpfox', '2.0.5dev2', 'try_again_in_time_seconds', 'Try again in {time} seconds.', 'Try again in {time} seconds.', 1275106296),
(1145, 'en', 'core', 'phpfox', '2.0.5dev2', 'try_again_in_1_second', 'Try again in 1 second.', 'Try again in 1 second.', 1275106549),
(1146, 'en', 'core', 'phpfox', '2.0.5dev2', 'setting_global_genders', '<title>Genders</title><info>This setting controls the genders used on this community. To add a new gender you need to populate it with 3 values separated by a pipe "|" (without quotes). Use the default Male and Female genders we provide as examples.\r\n The first value needs to be a unique numerical ID number. For Male and Female we use the numbers 1 and 2. We advice to go upwards from there. The 2nd field needs to be a phrase that you must first add using our language manager. Once you add a phrase it gives you several examples on how to use the phrase. We will be using the "Text" method, which is basically the variable name of the phrase and how we will connect to this specific word. So the 2nd value needs to be a phrase that identifies this gender. For Male and Female we used his and her. The 3rd value identifies the gender and must also be a phrase much like the 2nd value. For male and female we used Male and Female to populate this value.</info>', '<title>Genders</title><info>This setting controls the genders used on this community. To add a new gender you need to populate it with 3 values separated by a pipe "|" (without quotes). Use the default Male and Female genders we provide as examples.\r\n The first value needs to be a unique numerical ID number. For Male and Female we use the numbers 1 and 2. We advice to go upwards from there. The 2nd field needs to be a phrase that you must first add using our language manager. Once you add a phrase it gives you several examples on how to use the phrase. We will be using the "Text" method, which is basically the variable name of the phrase and how we will connect to this specific word. So the 2nd value needs to be a phrase that identifies this gender. For Male and Female we used his and her. The 3rd value identifies the gender and must also be a phrase much like the 2nd value. For male and female we used Male and Female to populate this value.</info>', 1275182678),
