(1151, 'en', 'core', 'phpfox', '2.0.7', 'your_website_has_surpassed_its_limit_on_how_many_active', 'Your website has surpassed its limit on how many active users you can have online at once. Below you will find a log of how many users you had and a time stamp of when it happened. We advice for you to upgrade your account so you do not encounter these interruptions in the future.', 'Your website has surpassed its limit on how many active users you can have online at once. Below you will find a log of how many users you had and a time stamp of when it happened. We advice for you to upgrade your account so you do not encounter these interruptions in the future.', 1287591667),
