(1160, 'en', 'core', 'phpfox', '2.0.7', 'setting_enabled_edit_area', '<title>Use Edit Area</title><info>Enable this to use <a href="http://www.cdolivet.com/index.php?page=editArea">EditArea</a> when editing code (HTML, PHP etc...) within the AdminCP. This feature transforms a conventional form into a code editor.</info>', '<title>Use Edit Area</title><info>Enable this to use <a href="http://www.cdolivet.com/index.php?page=editArea">EditArea</a> when editing code (HTML, PHP etc...) within the AdminCP. This feature transforms a conventional form into a code editor.</info>', 1288349480),
(1161, 'en', 'core', 'phpfox', '2.0.7', 'setting_group_ip_infodb', '<title>IP InfoDB</title><info>Free IP address geolocation tools</info>', '<title>IP InfoDB</title><info>Free IP address geolocation tools</info>', 1289988638),
(1162, 'en', 'core', 'phpfox', '2.0.7', 'setting_ip_infodb_api_key', '<title>IP InfoDB API Key</title><info>IP InfoDB is a free IP address geolocation tools we use to find useful information about users based on their IP. Enter your free API key, which you can get <a href="http://ipinfodb.com/register.php">here</a>.</info>', '<title>IP InfoDB API Key</title><info>IP InfoDB is a free IP address geolocation tools we use to find useful information about users based on their IP. Enter your free API key, which you can get <a href="http://ipinfodb.com/register.php">here</a>.</info>', 1289988772),
(1163, 'en', 'core', 'phpfox', '2.1.0Beta1', 'setting_load_jquery_from_google_cdn', '<title>Load jQuery from Google CDN</title><info>Enabling this option will load jQuery related JavaScript files from Google CDN servers. More information can be found <a href="http://code.google.com/apis/libraries/devguide.html">here</a>.</info>', '<title>Load jQuery from Google CDN</title><info>Enabling this option will load jQuery related JavaScript files from Google CDN servers. More information can be found <a href="http://code.google.com/apis/libraries/devguide.html">here</a>.</info>', 1292408370),
(1164, 'en', 'core', 'phpfox', '2.1.0Beta1', 'setting_jquery_google_cdn_version', '<title>jQuery Version on Google CDN</title><info>Define the version of jQuery that is available on <a href="http://code.google.com/apis/libraries/devguide.html#jquery">Google CDN</a> servers.</info>', '<title>jQuery Version on Google CDN</title><info>Define the version of jQuery that is available on <a href="http://code.google.com/apis/libraries/devguide.html#jquery">Google CDN</a> servers.</info>', 1292408517),
(1165, 'en', 'core', 'phpfox', '2.1.0Beta1', 'setting_jquery_ui_google_cdn_version', '<title>jQuery UI Version on Google CDN</title><info>Define the version of jQuery UI that is available on <a href="http://code.google.com/apis/libraries/devguide.html#jqueryUI">Google CDN</a> servers.</info>', '<title>jQuery UI Version on Google CDN</title><info>Define the version of jQuery UI that is available on <a href="http://code.google.com/apis/libraries/devguide.html#jqueryUI">Google CDN</a> servers.</info>', 1292408601),
(1166, 'en', 'core', 'phpfox', '2.1.0Beta1', 'setting_friends_only_community', '<title>Friends Only Community</title><info>By enabling this option certain sections (eg. Blogs, Photos etc...), will by default only show items from the member and his or her friends list. <b>Note:</b> In order for this to work you must enable the option <b>Section Privacy Item Browsing\r\n</b></info>', '<title>Friends Only Community</title><info>By enabling this option certain sections (eg. Blogs, Photos etc...), will by default only show items from the member and his or her friends list. <b>Note:</b> In order for this to work you must enable the option <b>Section Privacy Item Browsing\r\n</b></info>', 1293613541),
(1167, 'en', 'core', 'phpfox', '2.1.0Beta1', 'setting_site_wide_ajax_browsing', '<title>Site Wide AJAX Browsing</title><info>By enabling this option users will be able to browse certain areas on the site using AJAX. By using AJAX we only load the required data for the specific page to be displayed. This saves bandwidth and can greatly improve your servers overall performance due to the reduced number of requests to your servers.</info>', '<title>Site Wide AJAX Browsing</title><info>By enabling this option users will be able to browse certain areas on the site using AJAX. By using AJAX we only load the required data for the specific page to be displayed. This saves bandwidth and can greatly improve your servers overall performance due to the reduced number of requests to your servers.</info>', 1294768580),
(1168, 'en', 'core', 'phpfox', '3.0.0Beta1', 'setting_section_privacy_item_browsing', '<title>Section Privacy Item Browsing</title><info>Enabling this option will allow users to browse certain sections that allow privacy settings. By default we only display public items in what we call sections (eg. Blogs, Polls, Albums etc...). With this option enabled we will display items to the user that is viewing it based on the items privacy setting. Note that this option requires a load balanced server and in many cases several SQL servers just to support this sort of query on an active community.</info>', '<title>Section Privacy Item Browsing</title><info>Enabling this option will allow users to browse certain sections that allow privacy settings. By default we only display public items in what we call sections (eg. Blogs, Polls, Albums etc...). With this option enabled we will display items to the user that is viewing it based on the items privacy setting. Note that this option requires a load balanced server and in many cases several SQL servers just to support this sort of query on an active community.</info>', 1295254530),
(1169, 'en', 'core', 'phpfox', '3.0.0Beta1', 'setting_date_field_order', '<title>Calendar Date Format</title><info>The format for parsed and displayed dates. \r\nMDY = Month/Day/Year\r\nDMY = Day/Month/Year\r\nYMD = Year/Month/Day</info>', '<title>Calendar Date Format</title><info>The format for parsed and displayed dates. \r\nMDY = Month/Day/Year\r\nDMY = Day/Month/Year\r\nYMD = Year/Month/Day</info>', 1302345875),
(1170, 'en', 'core', 'phpfox', '3.0.0Beta1', 'setting_use_jquery_datepicker', '<title>Use Datepicker</title><info>Set this to "TRUE" to use a Datepicker on all areas that require users to select a date.</info>', '<title>Use Datepicker</title><info>Set this to "TRUE" to use a Datepicker on all areas that require users to select a date.</info>', 1302348657),
