(1179, 'en', 'core', 'phpfox', '2.1.0beta2', 'setting_cdn_amazon_https', '<title>Enable HTTPS Support</title><info>Set this to TRUE if a user is on a secure page to use HTTPS with Amazon S3 items. Note you will need to create your own certificate to work with Amazon S3 as they do not provide support for this by default.</info>', '<title>Enable HTTPS Support</title><info>Set this to TRUE if a user is on a secure page to use HTTPS with Amazon S3 items. Note you will need to create your own certificate to work with Amazon S3 as they do not provide support for this by default.</info>', 1301318031),
(1180, 'en', 'core', 'phpfox', '2.1.0rc1', 'upload_problems', 'Upload problems? Try the <a href="{link}">basic uploader</a> (works on older computers and web browsers).', 'Upload problems? Try the <a href="{link}">basic uploader</a> (works on older computers and web browsers).', 1301568603),
(1181, 'en', 'core', 'phpfox', '3.0.0beta1', 'user_setting_can_design_dnd', 'Can members of this user group enable the site designer to drag and drop blocks all around the site? (These changes affect the entire site and this feature is targeted to site administrators)', 'Can members of this user group enable the site designer to drag and drop blocks all around the site? (These changes affect the entire site and this feature is targeted to site administrators)', 1308659242),
(1182, 'en', 'core', 'phpfox', '3.0.0Beta1', 'menu_core_create_a_list_a441eadc1389cdf0ffe6c4f8babdd66e', 'Create a List', 'Create a List', 1310027894),
(1183, 'en', 'core', 'phpfox', '3.0.0beta1', 'setting_twitter_consumer_key', '<title>Consumer Key</title><info>Enter your Twitter consumer key.</info>', '<title>Consumer Key</title><info>Enter your Twitter consumer key.</info>', 1312530940),
(1184, 'en', 'core', 'phpfox', '3.0.0beta1', 'setting_twitter_consumer_secret', '<title>Consumer Secret</title><info>Enter your Twitter consumer secret.</info>', '<title>Consumer Secret</title><info>Enter your Twitter consumer secret.</info>', 1312530982),
(1185, 'en', 'core', 'phpfox', '3.0.0beta3', 'setting_allow_html_in_activity_feed', '<title>Allow HTML in Activity Feed</title><info>If you enable this option it will allow HTML in the activity feed and any comments connected to the feed.</info>', '<title>Allow HTML in Activity Feed</title><info>If you enable this option it will allow HTML in the activity feed and any comments connected to the feed.</info>', 1315510132),
(1186, 'en', 'core', 'phpfox', '3.0.0beta3', 'setting_disable_hash_bang_support', '<title>AJAX Browsing - Disable Hash-Bang URL</title><info>If you have "Site Wide AJAX Browsing" enabled we provide support for a function provided with HTML5 that allows the changing of the URL path without actually reloading the page. For browsers that do not have support for this function we use a fallback hash-bang URL. If you do not want to allow the usage of hash-bang URL''s enable this option and for browsers that do not have HTML 5 support will not be able to use your sites AJAX browsing functionality. Currently all IE browsers do not have support for this HTML5 function so they by default use the fallback method.</info>', '<title>AJAX Browsing - Disable Hash-Bang URL</title><info>If you have "Site Wide AJAX Browsing" enabled we provide support for a function provided with HTML5 that allows the changing of the URL path without actually reloading the page. For browsers that do not have support for this function we use a fallback hash-bang URL. If you do not want to allow the usage of hash-bang URL''s enable this option and for browsers that do not have HTML 5 support will not be able to use your sites AJAX browsing functionality. Currently all IE browsers do not have support for this HTML5 function so they by default use the fallback method.</info>', 1316512962),
