(1219, 'en', 'core', 'phpfox', '3.0.0rc1', 'setting_display_older_ie_error', '<title>IE8 or Higher Requirement Check</title><info>By default the script requires IE8 or higher. We will show users a notice if they are using an older version and a link to upgrade their browser. Disable this if you do not want to show a warning.</info>', '<title>IE8 or Higher Requirement Check</title><info>By default the script requires IE8 or higher. We will show users a notice if they are using an older version and a link to upgrade their browser. Disable this if you do not want to show a warning.</info>', 1320238795),
(1220, 'en', 'core', 'phpfox', '3.0.0rc1', 'ie8_or_higher_warning', 'You seem to be using an older version of Internet Explorer. This site requires Internet Explorer 8 or higher. Update your browser <a href="http://www.microsoft.com/ie/" target="_blank">here</a> today to fully enjoy all the marvels of this site.', 'You seem to be using an older version of Internet Explorer. This site requires Internet Explorer 8 or higher. Update your browser <a href="http://www.microsoft.com/ie/" target="_blank">here</a> today to fully enjoy all the marvels of this site.', 1320238851),
