(1225, 'en', 'core', 'phpfox', '3.0.1', 'setting_disable_ie_warning', '<title>Disable IE Warning</title><info>We display a warning for those that use Internet Explorer 7 or lower. Enable this setting if you do not want to display this warning.</info>', '<title>Disable IE Warning</title><info>We display a warning for those that use Internet Explorer 7 or lower. Enable this setting if you do not want to display this warning.</info>', 1327406336),
(1226, 'en', 'core', 'phpfox', '3.1.0beta1', 'setting_cdn_service', '<title>CDN Service</title><info>Select what CDN service you would like to use.</info>', '<title>CDN Service</title><info>Select what CDN service you would like to use.</info>', 1330603751),
(1227, 'en', 'core', 'phpfox', '3.1.0rc1', 'setting_enable_amazon_expire_urls', '<title>Enable Amazon Expiring URLs</title><info>If this setting is enabled and "Amazon Expire Timeout" is higher than zero, all paths to images taken from Amazon S3 will include a signature set to expire.<br />\r\nIf this setting is enabled images uploaded to S3 will be set to private. If this setting is later disabled those images will remain private and they will not show on your site until you manually revert their privacy.</info>', '<title>Enable Amazon Expiring URLs</title><info>If this setting is enabled and "Amazon Expire Timeout" is higher than zero, all paths to images taken from Amazon S3 will include a signature set to expire.<br />\r\nIf this setting is enabled images uploaded to S3 will be set to private. If this setting is later disabled those images will remain private and they will not show on your site until you manually revert their privacy.</info>', 1332254480);
INSERT INTO `themsg_language_phrase` (`phrase_id`, `language_id`, `module_id`, `product_id`, `version_id`, `var_name`, `text`, `text_default`, `added`) VALUES
(1228, 'en', 'core', 'phpfox', '3.1.0rc1', 'setting_amazon_s3_expire_url_timeout', '<title>Amazon Expire Timeout</title><info>How many seconds will the urls to the images be valid for.</info>', '<title>Amazon Expire Timeout</title><info>How many seconds will the urls to the images be valid for.</info>', 1332254771),
(1229, 'en', 'core', 'phpfox', '3.2.0beta1', 'site_statistics', 'Site Statistics', 'Site Statistics', 1334318165),
(1230, 'en', 'core', 'phpfox', '3.2.0beta1', 'setting_official_launch_of_site', '<title>Official Launch Date (Month/Day/Year)</title><info>This is the day your site was launched. It is used to create statistics for the site to build daily averages. The format is <b>Month/Day/Year</b>.</info>', '<title>Official Launch Date (Month/Day/Year)</title><info>This is the day your site was launched. It is used to create statistics for the site to build daily averages. The format is <b>Month/Day/Year</b>.</info>', 1334320691),
(1231, 'en', 'core', 'phpfox', '3.2.0beta1', 'total', 'Total', 'Total', 1334581180),
(1232, 'en', 'core', 'phpfox', '3.2.0beta1', 'daily_average', 'Daily Average', 'Daily Average', 1334581190),
(1233, 'en', 'core', 'phpfox', '3.2.0beta1', 'building_site_stats_please_hold', 'Building site stats. Please hold...', 'Building site stats. Please hold...', 1334581202),
(1234, 'en', 'core', 'phpfox', '3.2.0rc1', 'setting_use_md5_for_file_names', '<title>Use MD5 for File Names</title><info>If enabled the script will use an md5 hash for the file names of every uploaded file.\r\n\r\nIf you disable it extra checks will be added to try to preserve the original name of the file. If an item with the same name already exists the new one will have a number added at the end.</info>', '<title>Use MD5 for File Names</title><info>If enabled the script will use an md5 hash for the file names of every uploaded file.\r\n\r\nIf you disable it extra checks will be added to try to preserve the original name of the file. If an item with the same name already exists the new one will have a number added at the end.</info>', 1334918381),
(1235, 'en', 'core', 'phpfox', '3.3.0beta1', 'setting_no_follow_on_external_links', '<title>Add rel="nofollow" on External Links</title><info>If enabled this feature provides a way for webmasters to tell search engines to not follow any external links.</info>', '<title>Add rel="nofollow" on External Links</title><info>If enabled this feature provides a way for webmasters to tell search engines to not follow any external links.</info>', 1336977764),
(1236, 'en', 'core', 'phpfox', '3.3.0beta1', 'setting_rackspace_username', '<title>Rackspace Username</title><info>Enter your Rackspace username.</info>', '<title>Rackspace Username</title><info>Enter your Rackspace username.</info>', 1339346243),
(1237, 'en', 'core', 'phpfox', '3.3.0beta1', 'setting_rackspace_key', '<title>Rackspace API Key</title><info>Enter your Rackspace API key.</info>', '<title>Rackspace API Key</title><info>Enter your Rackspace API key.</info>', 1339346279),
