(1246, 'en', 'core', 'phpfox', '3.4.0rc1', 'you_are_about_to_gift_activity_points', 'You are about to gift activity points to the user <strong>{full_name}</strong>. These points will be taken from your activity points. <br />	At this moment you have <strong>{current}</strong> points available to gift.', 'You are about to gift activity points to the user <strong>{full_name}</strong>. These points will be taken from your activity points. <br />	At this moment you have <strong>{current}</strong> points available to gift.', 1349857399),
(1247, 'en', 'core', 'phpfox', '3.4.0rc1', 'you_only_have_one_point_available', 'You only have one point available, do you want to give it away to {full_name}?', 'You only have one point available, do you want to give it away to {full_name}?', 1349857434),
