(1250, 'en', 'core', 'phpfox', '3.4.0rc1', 'unfortunately_you_do_not_have_enough_points_to_gift_away', 'Unfortunately you do not have enough points to gift away, but you can earn more points by being more active in the site.', 'Unfortunately you do not have enough points to gift away, but you can earn more points by being more active in the site.', 1349857479),
(1251, 'en', 'core', 'phpfox', '3.5.0beta1', 'setting_keep_files_in_server', '<title>Keep Files In Server</title><info>Set this to TRUE to keep original files on the server.</info>', '<title>Keep Files In Server</title><info>Set this to TRUE to keep original files on the server.</info>', 1353415860),
(1252, 'en', 'core', 'phpfox', '3.5.0beta1', 'setting_google_api_key', '<title>Google API Key</title><info>Google offers many services that require an API key (like the Places service), enter your Google API key here.\r\n\r\nMore information on how to get an API key can be found <a href="https://developers.google.com/maps/documentation/javascript/tutorial#api_key">here</a>.</info>', '<title>Google API Key</title><info>Google offers many services that require an API key (like the Places service), enter your Google API key here.\r\n\r\nMore information on how to get an API key can be found <a href="https://developers.google.com/maps/documentation/javascript/tutorial#api_key">here</a>.</info>', 1353588797),
(1253, 'en', 'core', 'phpfox', '3.5.0', 'setting_activity_feed_line_breaks', '<title>Activity Feed Line Breaks</title><info>This feature controls how many line breaks to show in activity feed posts and comments. To enable this feature simply add a number higher than 0.</info>', '<title>Activity Feed Line Breaks</title><info>This feature controls how many line breaks to show in activity feed posts and comments. To enable this feature simply add a number higher than 0.</info>', 1361864310),
(1254, 'en', 'core', 'phpfox', '3.6.0rc1', 'setting_include_master_files', '<title>JS/CSS Include Master Files</title><info>This setting is designed to create 1 JS and 1 CSS master file so it would only be loaded once by the browser. Then when a user visits a page it will load another file that is specific to that page only. The file will be a lot smaller since it does not have any of the master data.</info>', '<title>JS/CSS Include Master Files</title><info>This setting is designed to create 1 JS and 1 CSS master file so it would only be loaded once by the browser. Then when a user visits a page it will load another file that is specific to that page only. The file will be a lot smaller since it does not have any of the master data.</info>', 1371725536),
(1255, 'en', 'core', 'phpfox', '3.6.0rc1', 'setting_defer_loading_user_images', '<title>Defer Profile Images</title><info>Load profile images after the site has loaded.</info>', '<title>Defer Profile Images</title><info>Load profile images after the site has loaded.</info>', 1371725698),
(1256, 'en', 'core', 'phpfox', '3.6.0rc1', 'setting_defer_loading_images', '<title>Defer Photos</title><info>Load photos from the Photo module after the site has loaded.</info>', '<title>Defer Photos</title><info>Load photos from the Photo module after the site has loaded.</info>', 1371725751),
(1257, 'en', 'core', 'phpfox', '3.6.0rc1', 'setting_keep_non_square_images', '<title>Keep Non Square Images</title><info>By default we create 2 thumbnails for each image. One keeps the original aspect ratio and the other is a fixed square image. With our current themes we only use the fixed square images. The original aspect ratio images are not really needed and disabling this feature is advised.</info>', '<title>Keep Non Square Images</title><info>By default we create 2 thumbnails for each image. One keeps the original aspect ratio and the other is a fixed square image. With our current themes we only use the fixed square images. The original aspect ratio images are not really needed and disabling this feature is advised.</info>', 1371726679),
(1258, 'en', 'core', 'phpfox', '3.6.0rc1', 'setting_controllers_to_load_delayed', '<title>Load sections via AJAX</title><info>You can define an array of controllers that will be loaded after the site has been loaded via AJAX.</info>', '<title>Load sections via AJAX</title><info>You can define an array of controllers that will be loaded after the site has been loaded via AJAX.</info>', 1371726829),
(1259, 'en', 'core', 'phpfox', '3.6.0rc1', 'setting_super_cache_system', '<title>Global Caching</title><info>Global caching setting. Enable to turn on caching system on several areas. Drops database queries.</info>', '<title>Global Caching</title><info>Global caching setting. Enable to turn on caching system on several areas. Drops database queries.</info>', 1371727047),
(1260, 'en', 'core', 'phpfox', '3.6.0rc1', 'setting_store_only_users_in_session', '<title>Only Users in Session Table</title><info>Only store users in the session table. Keeps bots and guests out from this table.</info>', '<title>Only Users in Session Table</title><info>Only store users in the session table. Keeps bots and guests out from this table.</info>', 1371732076),
(1261, 'en', 'core', 'phpfox', '3.6.0rc1', 'setting_push_jscss_to_cdn', '<title>Upload CSS/JS to CDN</title><info>Upload minified CSS/JS to CDN if minified files is enabled. Note you will still need to manually upload your themes images. This only works for CSS and JavaScript files.</info>', '<title>Upload CSS/JS to CDN</title><info>Upload minified CSS/JS to CDN if minified files is enabled. Note you will still need to manually upload your themes images. This only works for CSS and JavaScript files.</info>', 1371732268),
(1262, 'en', 'core', 'phpfox', '3.6.0rc1', 'setting_include_site_title_all_pages', '<title>Remove Site Title</title><info>Removes site title on all pages other then the index page and if a page has no title. This is to assist with duplicate content.</info>', '<title>Remove Site Title</title><info>Removes site title on all pages other then the index page and if a page has no title. This is to assist with duplicate content.</info>', 1371732664),
(1263, 'en', 'core', 'phpfox', '3.6.0rc1', 'setting_force_404_check', '<title>Force 404 Check</title><info>Enable to force 404 checks on sub-pages that do not exist. This works in selective sections.</info>', '<title>Force 404 Check</title><info>Enable to force 404 checks on sub-pages that do not exist. This works in selective sections.</info>', 1371732723),
(1264, 'en', 'core', 'phpfox', '3.6.0rc1', 'setting_enable_html_purifier', '<title>HTML PURIFIER</title><info>If enabled we will use a 3rd party library to assist in parsing content submitted by your users. Only enable this if you allow HTML on your site. To learn more about this product check out:\r\nhttp://htmlpurifier.org/\r\n\r\nYou can find additional settings in the file:\r\ninclude/setting/htmlpurifier.sett.php.new</info>', '<title>HTML PURIFIER</title><info>If enabled we will use a 3rd party library to assist in parsing content submitted by your users. Only enable this if you allow HTML on your site. To learn more about this product check out:\r\nhttp://htmlpurifier.org/\r\n\r\nYou can find additional settings in the file:\r\ninclude/setting/htmlpurifier.sett.php.new</info>', 1371733020),
(1265, 'en', 'core', 'phpfox', '3.6.0rc1', 'setting_group_security', '<title>Security</title><info>Manage security settings for your site.</info>', '<title>Security</title><info>Manage security settings for your site.</info>', 1371733071),
(1266, 'en', 'core', 'phpfox', '3.6.0rc1', 'setting_force_secure_site', '<title>Force HTTPS for Logged In Users</title><info>Enable to make all connections secure when a user is logged in. <b>Notice:</b> Your server must have HTTPS support.</info>', '<title>Force HTTPS for Logged In Users</title><info>Enable to make all connections secure when a user is logged in. <b>Notice:</b> Your server must have HTTPS support.</info>', 1371733146),
(1267, 'en', 'core', 'phpfox', '3.6.0rc1', 'setting_use_custom_cookie_names', '<title>Custom Cookie Names</title><info>Enable to use custom cookie names</info>', '<title>Custom Cookie Names</title><info>Enable to use custom cookie names</info>', 1371733182),
(1268, 'en', 'core', 'phpfox', '3.6.0rc1', 'setting_custom_cookie_names_hash', '<title>Custom Cookie Name Unique Salt</title><info>Create your own unique cookie name salt.</info>', '<title>Custom Cookie Name Unique Salt</title><info>Create your own unique cookie name salt.</info>', 1371733247),
(1269, 'en', 'core', 'phpfox', '3.6.0rc1', 'setting_protect_admincp_with_ips', '<title>AdminCP IP Access</title><info>Allow access to the AdminCP if an IP is added to this list. Comma separated.</info>', '<title>AdminCP IP Access</title><info>Allow access to the AdminCP if an IP is added to this list. Comma separated.</info>', 1371733289),
(1270, 'en', 'core', 'phpfox', '3.6.0rc1', 'setting_auth_user_via_session', '<title>Authenticate Users via Database Session Log</title><info>If you enable this option we will authenticate users via a database session log.</info>', '<title>Authenticate Users via Database Session Log</title><info>If you enable this option we will authenticate users via a database session log.</info>', 1371733504),
(1271, 'en', 'core', 'phpfox', '3.6.0rc1', 'setting_include_ip_sub_id_hash', '<title>User IP Substring in ID Hash</title><info>Enable to include a users IP substring in the ID hash. This makes it much harder for users to hijack another users session.</info>', '<title>User IP Substring in ID Hash</title><info>Enable to include a users IP substring in the ID hash. This makes it much harder for users to hijack another users session.</info>', 1371733576),
(1272, 'en', 'core', 'phpfox', '3.6.0rc1', 'setting_id_hash_salt', '<title>Unique Salt for ID Hash</title><info>Create your own unique hash for the authenticating ID hash.</info>', '<title>Unique Salt for ID Hash</title><info>Create your own unique hash for the authenticating ID hash.</info>', 1371733619),
(1273, 'en', 'core', 'phpfox', '3.6.0rc1', 'setting_check_body_for_text', '<title>HTML Body Check</title><info>Enable to check HTML body for specific text.</info>', '<title>HTML Body Check</title><info>Enable to check HTML body for specific text.</info>', 1371733697),
(1274, 'en', 'core', 'phpfox', '3.6.0rc1', 'setting_check_body_regex', '<title>HTML Body Check REGEX</title><info>Add your custom REGEX to check the HTML body.</info>', '<title>HTML Body Check REGEX</title><info>Add your custom REGEX to check the HTML body.</info>', 1371733742),
(1275, 'en', 'core', 'phpfox', '3.6.0rc1', 'setting_check_body_offline_message', '<title>HTML Body Check Failed Message</title><info>If the REGEX check fails, add a message we should display.</info>', '<title>HTML Body Check Failed Message</title><info>If the REGEX check fails, add a message we should display.</info>', 1371733838),
(1276, 'en', 'core', 'phpfox', '3.6.0rc1', 'setting_check_body_header', '<title>HTML Body Check Failed Response</title><info>Custom header to send the browser in case the HTML body check REGEX fails.</info>', '<title>HTML Body Check Failed Response</title><info>Custom header to send the browser in case the HTML body check REGEX fails.</info>', 1371733888),
(1277, 'en', 'core', 'phpfox', '3.6.0rc1', 'setting_html_purifier_allowed_html', '<title>HTML PURIFIER Allowed HTML</title><info>Comma separated list of HTML elements and attributes HTML Purifier should allow.\r\n\r\nTo learn more on how this setting works check out:\r\nhttp://htmlpurifier.org/live/configdoc/plain.html#HTML.Allowed</info>', '<title>HTML PURIFIER Allowed HTML</title><info>Comma separated list of HTML elements and attributes HTML Purifier should allow.\r\n\r\nTo learn more on how this setting works check out:\r\nhttp://htmlpurifier.org/live/configdoc/plain.html#HTML.Allowed</info>', 1371734080),
(1278, 'en', 'core', 'phpfox', '3.6.0rc1', 'setting_html_purifier_allowed_iframes', '<title>HTML PURIFIER Allowed IFRAMES REGEX</title><info>REGEX of sites HTML Purifier should allow when users use HTML IFRAMES.</info>', '<title>HTML PURIFIER Allowed IFRAMES REGEX</title><info>REGEX of sites HTML Purifier should allow when users use HTML IFRAMES.</info>', 1371734180),
(1279, 'en', 'core', 'phpfox', '3.7.0beta1', 'setting_city_in_registration', '<title>City in Registration</title><info>Enable this setting to allow visitors to enter their city when they are creating their account.</info>', '<title>City in Registration</title><info>Enable this setting to allow visitors to enter their city when they are creating their account.</info>', 1373891053),
