(1806, 'en', 'profile', 'phpfox', '3.5.0beta1', 'setting_display_submenu_for_photo', '<title>Display Sub-Menu for Photos</title><info>If this setting is enabled it will display a sub menu in the profiles where users can click to view "Albums" or "Photos". \r\nIf this setting is disabled that sub-menu will not be shown, and instead a bigger menu will be displayed on the right side. \r\nPlease note that this is only valid if Timeline is disabled.</info>', '<title>Display Sub-Menu for Photos</title><info>If this setting is enabled it will display a sub menu in the profiles where users can click to view "Albums" or "Photos". \r\nIf this setting is disabled that sub-menu will not be shown, and instead a bigger menu will be displayed on the right side. \r\nPlease note that this is only valid if Timeline is disabled.</info>', 1355998784),
(1807, 'en', 'profile', 'phpfox', '3.6.0rc1', 'setting_cache_blocks_design', '<title>Profile/Dashboard Design</title><info>Stops querying the table user_dashboard, which is used to store information about the block positioning on a users profiles or dashboard.</info>', '<title>Profile/Dashboard Design</title><info>Stops querying the table user_dashboard, which is used to store information about the block positioning on a users profiles or dashboard.</info>', 1371724344),
(1808, 'en', 'profile', 'phpfox', '3.6.0rc1', 'setting_profile_caches', '<title>Profile Tracking</title><info>This cache removes the track from profiles. It goes against privacy and is very difficult to circumvent efficiently.</info>', '<title>Profile Tracking</title><info>This cache removes the track from profiles. It goes against privacy and is very difficult to circumvent efficiently.</info>', 1371724865),
