(2083, 'en', 'user', 'phpfox', '2.0.0beta3', 'setting_usernames_to_suggest', '<title>Usernames to suggest</title><info>When users fail the username verification at signup several usernames will be suggested. \r\nThe values here are the first part of those suggestions, (the second part is a random number).\r\n\r\nPossible outcomes:\r\nuser234\r\nmember181\r\nfriend921</info>', '<title>Usernames to suggest</title><info>When users fail the username verification at signup several usernames will be suggested. \r\nThe values here are the first part of those suggestions, (the second part is a random number).\r\n\r\nPossible outcomes:\r\nuser234\r\nmember181\r\nfriend921</info>', 1244550909),
