(2094, 'en', 'user', 'phpfox', '2.0.0beta4', 'user_setting_total_times_can_change_user_name', 'How many times can this user group edit their user name?', 'How many times can this user group edit their user name?', 1244571909),
(2095, 'en', 'user', 'phpfox', '2.0.0beta4', 'setting_user_profile_private_age', '<title>Force Profile Privacy</title><info>Define what age should a users profile be forced to be private regardless of their profile privacy setting. \r\n\r\nIf the user&#039;s age is the the same or lower than the setting, only their friends will be able to see their profile and interact with them.\r\n\r\n<b>Notice:</b> Set to "0" (without quotes) for no limit.</info>', '<title>Force Profile Privacy</title><info>Define what age should a users profile be forced to be private regardless of their profile privacy setting. \r\n\r\nIf the user''s age is the the same or lower than the setting, only their friends will be able to see their profile and interact with them.\r\n\r\n<b>Notice:</b> Set to "0" (without quotes) for no limit.</info>', 1244573463),
(2096, 'en', 'user', 'phpfox', '2.0.0beta4', 'user_setting_can_block_other_members', 'Can block members?', 'Can block members?', 1244626170),
(2097, 'en', 'user', 'phpfox', '2.0.0beta4', 'user_setting_can_be_blocked_by_others', 'Can this user group be blocked by other users?', 'Can this user group be blocked by other users?', 1244626313),
(2098, 'en', 'user', 'phpfox', '2.0.0beta4', 'setting_validate_full_name', '<title>Validate Full/Display Name</title><info>Set to <b>True</b> if you would like to validate a users full name.</info>', '<title>Validate Full/Display Name</title><info>Set to <b>True</b> if you would like to validate a users full name.</info>', 1244645932),
(2099, 'en', 'user', 'phpfox', '2.0.0beta4', 'stat_title_1', 'Members', 'Members', 1245140437),
(2100, 'en', 'user', 'phpfox', '2.0.0beta5', 'user_setting_can_feature', 'Can members of this user group feature and unfeature members?', 'Can members of this user group feature and unfeature members?', 1246003244),
(2101, 'en', 'user', 'phpfox', '2.0.0beta5', 'setting_randomize_featured_members', '<title>Random featured members</title><info>Should featured members randomly show up?</info>', '<title>Random featured members</title><info>Should featured members randomly show up?</info>', 1246007440),
(2102, 'en', 'user', 'phpfox', '2.0.0beta5', 'setting_how_many_featured_members', '<title>How Many Featured Members To Show</title><info>This setting tells how many featured members will be shown at one time.</info>', '<title>How Many Featured Members To Show</title><info>This setting tells how many featured members will be shown at one time.</info>', 1246007756),
(2103, 'en', 'user', 'phpfox', '2.0.0beta5', 'setting_verify_email_at_signup', '<title>Verify Email At Signup</title><info>When a guest signs up, should they verify their email address?\r\n\r\nIf enabled an email will be sent with a special link to verify that is their address.</info>', '<title>Verify Email At Signup</title><info>When a guest signs up, should they verify their email address?\r\n\r\nIf enabled an email will be sent with a special link to verify that is their address.</info>', 1246354785),
(2104, 'en', 'user', 'phpfox', '2.0.0beta5', 'setting_verify_email_timeout', '<title>Verify Email Timeout</title><info>This setting tells how much time (in minutes) new members have in order to verify their email address.\r\n\r\nMake sure your email server is well configured as this setting relies on the user being able to click the link sent when they signed up.\r\n\r\nIf your site allows changing email address and you require the new one to be verified as well this setting also applies in this case.\r\n\r\nSet it to 0 to disable the timeout.</info>', '<title>Verify Email Timeout</title><info>This setting tells how much time (in minutes) new members have in order to verify their email address.\r\n\r\nMake sure your email server is well configured as this setting relies on the user being able to click the link sent when they signed up.\r\n\r\nIf your site allows changing email address and you require the new one to be verified as well this setting also applies in this case.\r\n\r\nSet it to 0 to disable the timeout.</info>', 1246355083),
(2105, 'en', 'user', 'phpfox', '2.0.0beta5', 'user_setting_can_change_email', 'Should members of this user group be allowed to change their email address?', 'Should members of this user group be allowed to change their email address?', 1246368069),
(2106, 'en', 'user', 'phpfox', '2.0.0beta5', 'setting_logout_after_change_email_if_verify', '<title>Logout After Changing Email</title><info>If users must verify their email address, when they change their email address should they be logged out so they need to verify right away?\r\n\r\nIf you set this to no they will be able to use the site until they sign out, after that they will need to verify their email address.</info>', '<title>Logout After Changing Email</title><info>If users must verify their email address, when they change their email address should they be logged out so they need to verify right away?\r\n\r\nIf you set this to no they will be able to use the site until they sign out, after that they will need to verify their email address.</info>', 1246370838),
(2107, 'en', 'user', 'phpfox', '2.0.0beta5', 'user_setting_can_verify_others_emails', 'Allow members of this user group to verify other''s email address from the AdminCP -> Users -> Browse Users ?', 'Allow members of this user group to verify other''s email address from the AdminCP -> Users -> Browse Users ?', 1246447720),
