(2514, 'en', 'user', 'phpfox', '2.0.0rc12', 'setting_on_register_privacy_setting', '<title>User Default Privacy Setting on Registration</title><info>With this setting you can control the default privacy setting for a user when they register. This will control how others view their profile.\r\n\r\nanyone = Anyone can view their profile.\r\n\r\nnetwork = Only members of the site can view their profile.\r\n\r\nfriends_only = Only their friends can view their profile.\r\n\r\nno_one = Nobody can view their profile.</info>', '<title>User Default Privacy Setting on Registration</title><info>With this setting you can control the default privacy setting for a user when they register. This will control how others view their profile.\r\n\r\nanyone = Anyone can view their profile.\r\n\r\nnetwork = Only members of the site can view their profile.\r\n\r\nfriends_only = Only their friends can view their profile.\r\n\r\nno_one = Nobody can view their profile.</info>', 1260914895),
