(2545, 'en', 'user', 'phpfox', '2.0.5dev1', 'setting_disable_username_on_sign_up', '<title>Disable Username on Registration</title><info>If this is enabled it will disable the "Username" field on the registration form. The Username is used to create a vanity URL of users (eg. http://www.site.com/username). If this is disabled we will use their unique ID number to create their vanity URL. You can then enable a user group setting that can allow users to edit their username at a later time.</info>', '<title>Disable Username on Registration</title><info>If this is enabled it will disable the "Username" field on the registration form. The Username is used to create a vanity URL of users (eg. http://www.site.com/username). If this is disabled we will use their unique ID number to create their vanity URL. You can then enable a user group setting that can allow users to edit their username at a later time.</info>', 1274282432),
