(2600, 'en', 'user', 'phpfox', '2.0.8', 'member_snoop_text', 'You are about to log in as the user <a href="{user_link}" target="_blank">{user_name}</a> ({full_name}). This has the same effect as if you logged in with that user''s password. When in this mode, all your actions will be	regarded as executed by {full_name}. <br /> To go back to your admin user you will need to log out and back in.', 'You are about to log in as the user <a href="{user_link}" target="_blank">{user_name}</a> ({full_name}). This has the same effect as if you logged in with that user''s password. When in this mode, all your actions will be	regarded as executed by {full_name}. <br /> To go back to your admin user you will need to log out and back in.', 1297697535),
