(2603, 'en', 'user', 'phpfox', '2.0.8', 'deny_mail_message', 'At this moment your profile does not meet the minimum requirements for our site. \r\nIf you feel this is an error, feel free to contact us to {site_email}', 'At this moment your profile does not meet the minimum requirements for our site. \r\nIf you feel this is an error, feel free to contact us to {site_email}', 1298464944),
(2604, 'en', 'user', 'phpfox', '2.0.8', 'you_are_about_to_deny_user', 'You are about to deny user <a href="{link}">{user_name}</a> from the site.\r\nIf you want to send an email to this user you may do it here', 'You are about to deny user <a href="{link}">{user_name}</a> from the site.\r\nIf you want to send an email to this user you may do it here', 1298470496),
(2605, 'en', 'user', 'phpfox', '2.0.8', 'deny_and_send_email', 'Deny and send email', 'Deny and send email', 1298471061),
