(2607, 'en', 'user', 'phpfox', '2.0.8', 'setting_brute_force_attempts_count', '<title>Brute Force Prevention: Attempts Count</title><info>How many attempts are allowed within the time limit? \r\n\r\nThis setting is used together with "Brute Force Prevention: Time limit" to better protect your site from brute force login attempts. \r\n\r\nYou define a time in minutes and how many failed attempts are allowed within that period of time, if a user fails to log in within that period of time, missing this many tries the account is locked for a certain time, this lock time is defined by the cool down time and during this time even if the correct log in is entered, access will be denied.</info>', '<title>Brute Force Prevention: Attempts Count</title><info>How many attempts are allowed within the time limit? \r\n\r\nThis setting is used together with "Brute Force Prevention: Time limit" to better protect your site from brute force login attempts. \r\n\r\nYou define a time in minutes and how many failed attempts are allowed within that period of time, if a user fails to log in within that period of time, missing this many tries the account is locked for a certain time, this lock time is defined by the cool down time and during this time even if the correct log in is entered, access will be denied.</info>', 1299680854),
(2608, 'en', 'user', 'phpfox', '2.0.8', 'setting_brute_force_time_check', '<title>Brute Force Prevention: Time Limit</title><info>How many minutes back should the script check?\r\nSet this to 0 if you do not want to run this check\r\n\r\nThis setting is used together with "Brute Force Prevention: Attempts Count" to better protect your site from brute force login attempts.</info>', '<title>Brute Force Prevention: Time Limit</title><info>How many minutes back should the script check?\r\nSet this to 0 if you do not want to run this check\r\n\r\nThis setting is used together with "Brute Force Prevention: Attempts Count" to better protect your site from brute force login attempts.</info>', 1299681159),
(2609, 'en', 'user', 'phpfox', '2.0.8', 'setting_brute_force_cool_down', '<title>Brute Force Prevention: Cool Down</title><info>When an account has been locked due to a brute force check, how many minutes should the user wait before unlocking the account?</info>', '<title>Brute Force Prevention: Cool Down</title><info>When an account has been locked due to a brute force check, how many minutes should the user wait before unlocking the account?</info>', 1299682133),
(2610, 'en', 'user', 'phpfox', '2.0.8', 'brute_force_account_locked', 'Brute force attempt logged. Your account has been locked for {iCoolDown} minutes. If you forgot your password please use the <a href="{sForgotLink}">Forgot Password tool</a>.\r\nYou can try to log in again in {iUnlockTimeOut} minutes.', 'Brute force attempt logged. Your account has been locked for {iCoolDown} minutes. If you forgot your password please use the <a href="{sForgotLink}">Forgot Password tool</a>.\r\nYou can try to log in again in {iUnlockTimeOut} minutes.', 1299683217),
