(2709, 'en', 'user', 'phpfox', '3.1.0beta1', 'setting_default_privacy_brithdate', '<title>Default Birthday Privacy Setting</title><info>Users can control their default privacy settings when it comes to how they want their birthdays to be displayed on their profile. When users sign up and have not chosen a privacy setting you can define a default setting for the site.\r\n\r\nHere is a key of what the values stand for...\r\n<b>full_birthday</b> = <i>Show full birthday</i>\r\n<b>month_day</b> = <i>Show month & day</i>\r\n<b>show_age</b> = <i>Only show the users age</i>\r\n<b>hide</b> = <i>Hide users age/birthday</i></info>', '<title>Default Birthday Privacy Setting</title><info>Users can control their default privacy settings when it comes to how they want their birthdays to be displayed on their profile. When users sign up and have not chosen a privacy setting you can define a default setting for the site.\r\n\r\nHere is a key of what the values stand for...\r\n<b>full_birthday</b> = <i>Show full birthday</i>\r\n<b>month_day</b> = <i>Show month & day</i>\r\n<b>show_age</b> = <i>Only show the users age</i>\r\n<b>hide</b> = <i>Hide users age/birthday</i></info>', 1330014202),
