(2712, 'en', 'user', 'phpfox', '3.1.0beta1', 'setting_no_show_activity_points', '<title>Show Activity Points on Dashboard</title><info>Enable this option to show the activity points displayed on the dashboard.</info>', '<title>Show Activity Points on Dashboard</title><info>Enable this option to show the activity points displayed on the dashboard.</info>', 1331554285),
(2713, 'en', 'user', 'phpfox', '3.1.0rc1', 'setting_shorter_password_reset_routine', '<title>Shorter Password Reset Routine</title><info>If this is enabled when a user clicks on Forgot your password he will receive an email with a link, when clicking on the link he will be shown an input where to change the password. The site will not assign a new password to that user and the previous password will work until it has been reset.</info>', '<title>Shorter Password Reset Routine</title><info>If this is enabled when a user clicks on Forgot your password he will receive an email with a link, when clicking on the link he will be shown an input where to change the password. The site will not assign a new password to that user and the previous password will work until it has been reset.</info>', 1332231623),
