(3167, 'en', 'attachment', 'phpfox', '2.0.8', 'setting_attachment_enable_mass_uploader', '<title>Enable Mass Uploader</title><info>When enabled users will be allowed to use a mass file uploader to select multiple files from a single file select dialog.\r\n\r\nThis uses an integration of SWFUpload (http://code.google.com/p/swfupload/) and thus it uses a Flash object.</info>', '<title>Enable Mass Uploader</title><info>When enabled users will be allowed to use a mass file uploader to select multiple files from a single file select dialog.\r\n\r\nThis uses an integration of SWFUpload (http://code.google.com/p/swfupload/) and thus it uses a Flash object.</info>', 1295623916),
