(3192, 'en', 'blog', 'phpfox', '2.0.0alpha1', 'user_setting_can_password_protect_blogs', 'Can password protect blogs?\r\n\r\nIf set to <b>Yes</b> and if user would try to view a password protected blog they will not be able to view or comment on the blog unless they enter the correct password.\r\n\r\nThe user that added the blog will not have to enter the password.', 'Can password protect blogs?\r\n\r\nIf set to <b>Yes</b> and if user would try to view a password protected blog they will not be able to view or comment on the blog unless they enter the correct password.\r\n\r\nThe user that added the blog will not have to enter the password.', 1214436544),
