(3195, 'en', 'blog', 'phpfox', '2.0.0alpha1', 'user_setting_can_view_password_protected_blog', 'Can view password protected blogs?\r\n\r\nIf a blog has been password protected a user will have to enter a password before they can view or comment on the blog. \r\n\r\nIf this feature is set to <b>No</b> they will not have the opportunity to enter a password thus not allowing them to view such blogs.', 'Can view password protected blogs?\r\n\r\nIf a blog has been password protected a user will have to enter a password before they can view or comment on the blog. \r\n\r\nIf this feature is set to <b>No</b> they will not have the opportunity to enter a password thus not allowing them to view such blogs.', 1214975898),
