(3388, 'en', 'blog', 'phpfox', '3.0.0Beta1', 'setting_blog_cache_minutes', '<title>Blog Cache (Minutes)</title><info>Define how many minutes to wait until blogs are repopulated with new data.\r\n\r\nSet this to "0" (without quotes) to always output the latest data.\r\n\r\nNote for larger communities we strongly advice to enable this feature as this will improve your sites overall performance.</info>', '<title>Blog Cache (Minutes)</title><info>Define how many minutes to wait until blogs are repopulated with new data.\r\n\r\nSet this to "0" (without quotes) to always output the latest data.\r\n\r\nNote for larger communities we strongly advice to enable this feature as this will improve your sites overall performance.</info>', 1295019128),
(3389, 'en', 'blog', 'phpfox', '3.0.0Beta1', 'setting_total_pages_to_cache_blog', '<title>Total Pages to Cache</title><info>By default we display 5 blogs per page on the blog section. If caching is enabled this setting controls how many blogs to cache thus allowing users to browse X number of pages in cache before running a query to retrieve live data. If we display 5 items per page and this setting is set to 4 it will cache 20 blogs as we multiply the total blogs we display by this setting.</info>', '<title>Total Pages to Cache</title><info>By default we display 5 blogs per page on the blog section. If caching is enabled this setting controls how many blogs to cache thus allowing users to browse X number of pages in cache before running a query to retrieve live data. If we display 5 items per page and this setting is set to 4 it will cache 20 blogs as we multiply the total blogs we display by this setting.</info>', 1295255472),
