(3449, 'en', 'captcha', 'phpfox', '2.0.0rc12', 'setting_recaptcha', '<title>Enable reCAPTCHA</title><info>By enabling <a href="http://recaptcha.net/" target="_blank">reCAPTCHA</a>, wherever we use a captcha routine to prevent spam it will be replaced with reCAPTCHA.\r\n\r\nYou can sign up for a free account at <a href="http://recaptcha.net/" target="_blank">reCAPTCHA</a>.\r\n\r\n<b>Notice:</b> This feature is experimental and is not stable.</info>', '<title>Enable reCAPTCHA</title><info>By enabling <a href="http://recaptcha.net/" target="_blank">reCAPTCHA</a>, wherever we use a captcha routine to prevent spam it will be replaced with reCAPTCHA.\r\n\r\nYou can sign up for a free account at <a href="http://recaptcha.net/" target="_blank">reCAPTCHA</a>.\r\n\r\n<b>Notice:</b> This feature is experimental and is not stable.</info>', 1260884933),
