(3452, 'en', 'captcha', 'phpfox', '2.0.0rc12', 'setting_recaptcha_header', '<title>reCAPTCHA Header</title><info>You can modify the style of reCAPTCHA by adding JavaScript to the template header and by adding CSS to the same header or for each theme.\r\n\r\nMore information can be found <a href="http://code.google.com/intl/en/apis/recaptcha/docs/customization.html" target="_blank">here</a>.</info>', '<title>reCAPTCHA Header</title><info>You can modify the style of reCAPTCHA by adding JavaScript to the template header and by adding CSS to the same header or for each theme.\r\n\r\nMore information can be found <a href="http://code.google.com/intl/en/apis/recaptcha/docs/customization.html" target="_blank">here</a>.</info>', 1260886253),
