(4170, 'en', 'feed', 'phpfox', '2.0.6', 'setting_feedcache_timeout', '<title>Cache Feeds</title><info>Value is in minutes.\r\nThis greatly improves performance on sites with a medium to large user base</info>', '<title>Cache Feeds</title><info>Value is in minutes.\r\nThis greatly improves performance on sites with a medium to large user base</info>', 1282124296),
(4171, 'en', 'feed', 'phpfox', '3.0.0Beta1', 'setting_total_likes_to_display', '<title>Total Likes to Display</title><info>Define how many users should be displayed when an item/feed is Liked.</info>', '<title>Total Likes to Display</title><info>Define how many users should be displayed when an item/feed is Liked.</info>', 1295002683),
(4172, 'en', 'feed', 'phpfox', '3.0.0Beta1', 'setting_group_duplicate_feeds', '<title>Group Duplicate Feeds</title><info>Define how many feeds to group when a user posts a feed that is part of the same item group (eg. Photo, Blogs, Status Update etc...). If you set this to "0" (without quotes) this will not group any feeds. \r\n\r\nNote this feature only works on the global activity feed and not on the users profile and is designed to prevent content SPAM.</info>', '<title>Group Duplicate Feeds</title><info>Define how many feeds to group when a user posts a feed that is part of the same item group (eg. Photo, Blogs, Status Update etc...). If you set this to "0" (without quotes) this will not group any feeds. \r\n\r\nNote this feature only works on the global activity feed and not on the users profile and is designed to prevent content SPAM.</info>', 1296125315),
(4173, 'en', 'feed', 'phpfox', '2.1.0beta2', 'setting_height_for_resized_videos', '<title>Height for Resized Videos</title><info>If the setting "Resize Embedded Videos" (in Content Formatting) is enabled, how tall should the embedded video be?\r\n\r\nPlease remember that this setting depends on "Resize Embedded Videos" to be enabled.</info>', '<title>Height for Resized Videos</title><info>If the setting "Resize Embedded Videos" (in Content Formatting) is enabled, how tall should the embedded video be?\r\n\r\nPlease remember that this setting depends on "Resize Embedded Videos" to be enabled.</info>', 1300963794),
(4174, 'en', 'feed', 'phpfox', '2.1.0beta2', 'setting_width_for_resized_videos', '<title>Width for Resized Videos</title><info>If the setting "Resize Embedded Videos" (in Content Formatting) is enabled, how wide should the embedded video be?\r\n\r\nPlease remember that this setting depends on "Resize Embedded Videos" to be enabled.</info>', '<title>Width for Resized Videos</title><info>If the setting "Resize Embedded Videos" (in Content Formatting) is enabled, how wide should the embedded video be?\r\n\r\nPlease remember that this setting depends on "Resize Embedded Videos" to be enabled.</info>', 1300963796),
(4175, 'en', 'feed', 'phpfox', '3.0.0beta1', 'setting_refresh_activity_feed', '<title>Refresh Activity Feed (Seconds)</title><info>This setting controls if you want to find new updates in the activity feed without having the user to refresh the page. This will use AJAX and the value of this setting has to be a number in seconds. If you want this feature to be disabled set it to the number zero (0).</info>', '<title>Refresh Activity Feed (Seconds)</title><info>This setting controls if you want to find new updates in the activity feed without having the user to refresh the page. This will use AJAX and the value of this setting has to be a number in seconds. If you want this feature to be disabled set it to the number zero (0).</info>', 1309267841),
(4176, 'en', 'feed', 'phpfox', '3.0.0beta3', 'setting_feed_limit_days', '<title>Feed Limit (Days)</title><info>This setting controls how many days we should look back when displaying feeds. If you set this to 0 it will look for all the feeds. We advice to add a limit to keep your site fresh. Note that this setting does not apply when viewing a users profile as it will list all of their feeds.</info>', '<title>Feed Limit (Days)</title><info>This setting controls how many days we should look back when displaying feeds. If you set this to 0 it will look for all the feeds. We advice to add a limit to keep your site fresh. Note that this setting does not apply when viewing a users profile as it will list all of their feeds.</info>', 1316518935),
