(4580, 'en', 'forum', 'phpfox', '2.0.5dev2', 'setting_forum_database_tracking', '<title>Database Tracking</title><info>If this option is enabled it will track users by storing the threads they have viewed in the database. As opposed to storing recent threads in cookies and basing if a user has viewed a thread or not on several time stamps. With this feature enabled it is much more accurate, however it requires extra server resources and on large forums it is best to disable this feature.</info>', '<title>Database Tracking</title><info>If this option is enabled it will track users by storing the threads they have viewed in the database. As opposed to storing recent threads in cookies and basing if a user has viewed a thread or not on several time stamps. With this feature enabled it is much more accurate, however it requires extra server resources and on large forums it is best to disable this feature.</info>', 1275199323),
