(4661, 'en', 'friend', 'phpfox', '2.0.0beta3', 'setting_friend_user_feed_display_limit', '<title>Total Pride Mate Display (User Selection)</title><info>Define how many friends a user can select to be displayed on their dashboard or profile.</info>', '<title>Total Friends Display (User Selection)</title><info>Define how many friends a user can select to be displayed on their dashboard or profile.</info>', 1243631308),
