(4664, 'en', 'friend', 'phpfox', '2.0.0beta4', 'setting_enable_birthday_notices', '<title>Enable Birthday Notices</title><info>When enabled users will see a list of their Pride Mate upcoming birthdays.</info>', '<title>Enable Birthday Notices</title><info>When enabled users will see a list of their friends upcoming birthdays.</info>', 1244723490),
(4665, 'en', 'friend', 'phpfox', '2.0.0beta4', 'setting_days_to_check_for_birthday', '<title>How many days in advance to check for birthdays</title><info>This setting tells how many days in advance should the script check for.\r\n\r\nSetting it to a number too high may beat the purpose of the feature.\r\n\r\nThe results from this feature cannot be cached, so it is prone to becoming a slow down for your site.\r\n\r\nKeep in mind that you can disable this feature altogether in the setting friend.enable_birthday_notices</info>', '<title>How many days in advance to check for birthdays</title><info>This setting tells how many days in advance should the script check for.\r\n\r\nSetting it to a number too high may beat the purpose of the feature.\r\n\r\nThe results from this feature cannot be cached, so it is prone to becoming a slow down for your site.\r\n\r\nKeep in mind that you can disable this feature altogether in the setting friend.enable_birthday_notices</info>', 1244723907),
(4666, 'en', 'friend', 'phpfox', '2.0.0beta4', 'setting_birthdays_cache_time_out', '<title>Birthdays Cache Time Out</title><info>Showing your friend&#039;s birthdays in the dashboard has a cost in database calls, therefore we cache it to save time and avoid extra calls.\r\n\r\nThis setting tells how often should the cache be refreshed, its set in hours so if you set it to 5 it means that every 5 hours the list of friends whose birthday is coming soon will be refreshed. This is helpful for new sign ups whose birthday is within 1 day.\r\n\r\nThis setting complements days_to_check_for_birthday and is useless if enable_birthday_notices is disabled.</info>', '<title>Birthdays Cache Time Out</title><info>Showing your friend''s birthdays in the dashboard has a cost in database calls, therefore we cache it to save time and avoid extra calls.\r\n\r\nThis setting tells how often should the cache be refreshed, its set in hours so if you set it to 5 it means that every 5 hours the list of friends whose birthday is coming soon will be refreshed. This is helpful for new sign ups whose birthday is within 1 day.\r\n\r\nThis setting complements days_to_check_for_birthday and is useless if enable_birthday_notices is disabled.</info>', 1245154442),
(4667, 'en', 'friend', 'phpfox', '2.0.0beta4', 'setting_show_empty_birthdays', '<title>Show Empty Birthdays</title><info>When enabled the site will show the block in the dashboard regardless if the user has Pride Mate whose birthday is coming or not. \r\n\r\nDisabling it does not mean a performance optimization since the contents are already cached.</info>', '<title>Show Empty Birthdays</title><info>When enabled the site will show the block in the dashboard regardless if the user has friends whose birthday is coming or not. \r\n\r\nDisabling it does not mean a performance optimization since the contents are already cached.</info>', 1245159765),
