(4821, 'en', 'friend', 'phpfox', '2.0.0rc12', 'setting_friend_suggestion_search_total', '<title>Pride Mate Suggestion     Pride Mate Check Count</title><info>When performing the search to find Pride Mate suggestions for your members it will pull out X amount of users, where X is the numerical value of how many Pride Mate to search.</info>', '<title>Friends Suggestion Friends Check Count</title><info>When performing the search to find friend suggestions for your members it will pull out X amount of users, where X is the numerical value of how many friends to search.</info>', 1260554251),
(4822, 'en', 'friend', 'phpfox', '2.0.0rc12', 'setting_enable_friend_suggestion', '<title>Pride Mate Suggestions</title><info>Enable this if you want to suggest friends to your members when they visit their dashboard.\r\n\r\nYou can control the search criteria on what defines a friend to suggest.\r\n\r\nThis feature requires a lot of extra server resources in order to perform such a search. \r\n\r\nEach search result is cached for X minutes (where you can control X).\r\n\r\n<b>Notice:</b> This feature is experimental and is not stable.\r\n</info>', '<title>Friend Suggestions</title><info>Enable this if you want to suggest friends to your members when they visit their dashboard.\r\n\r\nYou can control the search criteria on what defines a friend to suggest.\r\n\r\nThis feature requires a lot of extra server resources in order to perform such a search. \r\n\r\nEach search result is cached for X minutes (where you can control X).\r\n\r\n<b>Notice:</b> This feature is experimental and is not stable.\r\n</info>', 1260554523),
(4823, 'en', 'friend', 'phpfox', '2.0.0rc12', 'setting_friend_suggestion_timeout', '<title>Refresh Pride Mate Suggestions</title><info>Define how long to wait till we run the search to find Pride Mate to suggest to a member in minutes.</info>', '<title>Refresh Friend Suggestions</title><info>Define how long to wait till we run the search to find friends to suggest to a member in minutes.</info>', 1260554689),
(4824, 'en', 'friend', 'phpfox', '2.0.0rc12', 'setting_friend_suggestion_user_based', '<title>Check Location for Pride Mate Suggestions</title><info>Enable this option in order for us to pick up friend suggestions for your members based on the Country, State/Province and City they live in.</info>', '<title>Check Location for Friend Suggestions</title><info>Enable this option in order for us to pick up friend suggestions for your members based on the Country, State/Province and City they live in.</info>', 1260729076),
