(5094, 'en', 'mail', 'phpfox', '2.0.0alpha1', 'setting_show_core_mail_folders_item_count', '<title>Show inbox, sentbox and deletebox item count</title><info>If enabled will display the mail count totals in each folder, i.e.:\r\n\r\ninbox (2)\r\nsentbox (6)\r\ndelete (10)</info>', '<title>Show inbox, sentbox and deletebox item count</title><info>If enabled will display the mail count totals in each folder, i.e.:\r\n\r\ninbox (2)\r\nsentbox (6)\r\ndelete (10)</info>', 1233234365),
(5095, 'en', 'mail', 'phpfox', '2.0.0alpha1', 'user_setting_show_core_mail_folders_item_count', 'When enabled shows how many messages are in the inbox, sentbox and deletebox of every profile. \r\n\r\nNote that this adds extra queries to your database.', 'When enabled shows how many messages are in the inbox, sentbox and deletebox of every profile. \r\n\r\nNote that this adds extra queries to your database.', 1233235474),
(5096, 'en', 'mail', 'phpfox', '2.0.0alpha2', 'setting_display_total_mail_count', '<title>Display Total Mail Count</title><info>Set to <b>True</b> if you would like to display the number of new messages a user has beside the main "Mail" link found in the main menu by default.\r\n\r\n<b>Notice:</b> This will add an extra SQL query.</info>', '<title>Display Total Mail Count</title><info>Set to <b>True</b> if you would like to display the number of new messages a user has beside the main "Mail" link found in the main menu by default.\r\n\r\n<b>Notice:</b> This will add an extra SQL query.</info>', 1237808974),
(5097, 'en', 'mail', 'phpfox', '2.0.0alpha2', 'user_setting_can_add_attachment_on_mail', 'Can add attachments?', 'Can add attachments?', 1237813579),
(5098, 'en', 'mail', 'phpfox', '2.0.0beta5', 'user_setting_mail_box_limit', 'This setting tells how many messages can be stored based on the user group. It is complemented by the setting override_mail_box_limit to allow administrators and staff members to store any number of messages.\r\n\r\nThis setting does not work with threaded mail.', 'This setting tells how many messages can be stored based on the user group. It is complemented by the setting override_mail_box_limit to allow administrators and staff members to store any number of messages.\r\n\r\nThis setting does not work with threaded mail.', 1245750405),
(5099, 'en', 'mail', 'phpfox', '2.0.0beta5', 'user_setting_override_mail_box_limit', 'This setting tells if members of this user group can overcome the limit imposed by the setting mail_box_limit.\r\n\r\nBy default only administrators and staff members can have unlimited messages stored.', 'This setting tells if members of this user group can overcome the limit imposed by the setting mail_box_limit.\r\n\r\nBy default only administrators and staff members can have unlimited messages stored.', 1245750539);
INSERT INTO `themsg_language_phrase` (`phrase_id`, `language_id`, `module_id`, `product_id`, `version_id`, `var_name`, `text`, `text_default`, `added`) VALUES
(5100, 'en', 'mail', 'phpfox', '2.0.0beta5', 'user_setting_restrict_message_to_friends', 'This setting tells if the user can only send messages to people in his/her friends list.', 'This setting tells if the user can only send messages to people in his/her friends list.', 1245765917),
(5101, 'en', 'mail', 'phpfox', '2.0.0beta5', 'user_setting_can_message_self', 'This setting controls if members of this user group can send messages to themselves.', 'This setting controls if members of this user group can send messages to themselves.', 1245767264),
(5102, 'en', 'mail', 'phpfox', '2.0.0beta5', 'user_setting_override_restrict_message_to_friends', 'Members allowed to override the "restrict_message_to_friends" will be able to receive messages regardless if they are friends of the sender or not.', 'Members allowed to override the "restrict_message_to_friends" will be able to receive messages regardless if they are friends of the sender or not.', 1245767642),
(5103, 'en', 'mail', 'phpfox', '2.0.0beta5', 'user_setting_mail_box_warning', 'When users are about to use all their allowed mail space a warning will be shown. \r\n\r\nThis setting tells what percentage of their mail capacity must be used before showing this warning.\r\n\r\nSet it to zero to never show a warning.', 'When users are about to use all their allowed mail space a warning will be shown. \r\n\r\nThis setting tells what percentage of their mail capacity must be used before showing this warning.\r\n\r\nSet it to zero to never show a warning.', 1245847270),
(5104, 'en', 'mail', 'phpfox', '2.0.0beta5', 'setting_enable_mail_box_warning', '<title>Show Warning When Approaching Maibox Limit</title><info>This setting overrides the user group setting ''mail.mail_box_warning''. If this setting is disabled no warning will be shown regardless of whats set in mail.mail_box_warning.</info>', '<title>Show Warning When Approaching Maibox Limit</title><info>This setting overrides the user group setting ''mail.mail_box_warning''. If this setting is disabled no warning will be shown regardless of whats set in mail.mail_box_warning.</info>', 1245851230),
(5105, 'en', 'mail', 'phpfox', '2.0.0beta5', 'user_setting_allow_delete_every_message', 'When enabled this setting allows users to delete all the messages from the current folder without having to delete several times or going through the pager.\r\n\r\nA new option will be shown in the mail selector with the count of messages to delete next in parenthesis.\r\n\r\nexample:\r\n   None\r\n   Read\r\n   Unread\r\n   All\r\n-> All(24)', 'When enabled this setting allows users to delete all the messages from the current folder without having to delete several times or going through the pager.\r\n\r\nA new option will be shown in the mail selector with the count of messages to delete next in parenthesis.\r\n\r\nexample:\r\n   None\r\n   Read\r\n   Unread\r\n   All\r\n-> All(24)', 1245851578),
(5106, 'en', 'mail', 'phpfox', '2.0.0beta5', 'setting_enable_cron_delete_old_mail', '<title>Auto Delete Old Mail</title><info>This setting enables or disables the auto deletion of old messages.\r\n\r\nYou can set how old a message should be to be deleted in the setting <setting>mail.message_age_to_delete</setting>.\r\n\r\nYou can set how often to run this job in the setting <setting>mail.cron_delete_messages_delay</setting>.</info>', '<title>Auto Delete Old Mail</title><info>This setting enables or disables the auto deletion of old messages.\r\n\r\nYou can set how old a message should be to be deleted in the setting <setting>mail.message_age_to_delete</setting>.\r\n\r\nYou can set how often to run this job in the setting <setting>mail.cron_delete_messages_delay</setting>.</info>', 1245932314),
(5107, 'en', 'mail', 'phpfox', '2.0.0beta5', 'setting_cron_delete_messages_delay', '<title>Auto Delete Messages Delay</title><info>This setting tells how often (in days) will the auto deleter remove old messages.</info>', '<title>Auto Delete Messages Delay</title><info>This setting tells how often (in days) will the auto deleter remove old messages.</info>', 1245932446),
(5108, 'en', 'mail', 'phpfox', '2.0.0beta5', 'setting_message_age_to_delete', '<title>An Old Message Is...</title><info>This setting tells how old a message must be in (in days) order to be auto deleted.\r\n\r\nThis setting is directly dependent on <setting>mail.enable_cron_delete_old_mail</setting>.</info>', '<title>An Old Message Is...</title><info>This setting tells how old a message must be in (in days) order to be auto deleted.\r\n\r\nThis setting is directly dependent on <setting>mail.enable_cron_delete_old_mail</setting>.</info>', 1245932715),
(5109, 'en', 'mail', 'phpfox', '2.0.0beta5', 'setting_delete_sent_when_account_cancel', '<title>Delete Sent Mail</title><info>When a user cancels their account should the system delete the sent messages?\r\n\r\nThis affects the other user''s received messages list and is enabled by default.</info>', '<title>Delete Sent Mail</title><info>When a user cancels their account should the system delete the sent messages?\r\n\r\nThis affects the other user''s received messages list and is enabled by default.</info>', 1246883093),
(5110, 'en', 'mail', 'phpfox', '30', 'user_setting_can_read_private_messages', 'Can members of this user group read private messages in your site?', 'Can members of this user group read private messages in your site?', 1247588434),
(5111, 'en', 'mail', 'phpfox', '30', 'user_setting_can_delete_others_messages', 'Can members of this user group delete other people''s messages?', 'Can members of this user group delete other people''s messages?', 1247742397),
