(6275, 'en', 'photo', 'phpfox', '2.0.4', 'setting_how_many_categories_to_show_in_title', '<title>How many categories to show in title</title><info>When viewing a photo with categories assigned you can show these categories in the title of the page.\r\nThis setting tells how many categories to show. Set to 0 if you dont want to show categories in the title of the page when viewing a photo.</info>', '<title>How many categories to show in title</title><info>When viewing a photo with categories assigned you can show these categories in the title of the page.\r\nThis setting tells how many categories to show. Set to 0 if you dont want to show categories in the title of the page when viewing a photo.</info>', 1268150470),
