(6280, 'en', 'photo', 'phpfox', '2.0.0alpha1', 'user_setting_max_number_of_albums', 'Define the total number of photo albums a user within this user group can create.\r\n\r\n<b>Notice:</b> If you set this value to <b>null</b> it will allow them to create an unlimited amount of photo albums. Setting this value to <b>0</b> will not allow them the ability to create photo albums.', 'Define the total number of photo albums a user within this user group can create.\r\n\r\n<b>Notice:</b> If you set this value to <b>null</b> it will allow them to create an unlimited amount of photo albums. Setting this value to <b>0</b> will not allow them the ability to create photo albums.', 1234008456),
