(6287, 'en', 'photo', 'phpfox', '2.0.0alpha1', 'user_setting_max_images_per_upload', 'Define the maximum number of images a user can upload each time they use the upload form.\r\n\r\n<b>Notice:</b> This setting does not control how many images a user can upload in total, just how many they can upload each time they use the upload form to upload new images.', 'Define the maximum number of images a user can upload each time they use the upload form.\r\n\r\n<b>Notice:</b> This setting does not control how many images a user can upload in total, just how many they can upload each time they use the upload form to upload new images.', 1234357193),
