(6294, 'en', 'photo', 'phpfox', '2.0.0alpha1', 'user_setting_default_photo_display_limit', 'Define how many photos should be displayed by default.\r\n\r\n<b>Notice:</b> This value must be part of the setting <setting>photo.total_photos_displays</setting> array in order to be valid.', 'Define how many photos should be displayed by default.\r\n\r\n<b>Notice:</b> This value must be part of the setting <setting>photo.total_photos_displays</setting> array in order to be valid.', 1234464570),
(6295, 'en', 'photo', 'phpfox', '2.0.0alpha1', 'user_setting_max_photo_display_limit', 'Define the max number of photos a user can view on each page. \r\n\r\n<b>Notice:</b> This value should work together with the setting <setting>photo.total_photos_displays</setting> and in most cases should either be the same value as the highest number in the array or lower. The reason to set this value lower is to show users that the gallery can at max view 100 per page but maybe you only want this specific user group to display 24 images out of that max total (100).', 'Define the max number of photos a user can view on each page. \r\n\r\n<b>Notice:</b> This value should work together with the setting <setting>photo.total_photos_displays</setting> and in most cases should either be the same value as the highest number in the array or lower. The reason to set this value lower is to show users that the gallery can at max view 100 per page but maybe you only want this specific user group to display 24 images out of that max total (100).', 1234464816),
(6296, 'en', 'photo', 'phpfox', '2.0.0alpha1', 'user_setting_refresh_featured_photo', 'Define how many minutes or seconds the script should wait until it refreshes the feature photo.\r\n\r\n<b>Notice:</b> To add X minutes here are some examples:\r\n[code]\r\n1 min\r\n2 min\r\n30 min\r\n[/code]\r\nIf you would like to define it in seconds here are some examples:\r\n[code]\r\n20 sec\r\n30 sec\r\n90 sec\r\n[/code]', 'Define how many minutes or seconds the script should wait until it refreshes the feature photo.\r\n\r\n<b>Notice:</b> To add X minutes here are some examples:\r\n[code]\r\n1 min\r\n2 min\r\n30 min\r\n[/code]\r\nIf you would like to define it in seconds here are some examples:\r\n[code]\r\n20 sec\r\n30 sec\r\n90 sec\r\n[/code]', 1234468064),
