(6304, 'en', 'photo', 'phpfox', '2.0.0alpha1', 'user_setting_can_view_hidden_photos', 'Can view hidden photos?\r\n\r\n<b>Notice:</b> This is intended for a user group with Admin rights as this will allow them full access to all photos uploaded on the site, which in return can give them control to moderate images.', 'Can view hidden photos?\r\n\r\n<b>Notice:</b> This is intended for a user group with Admin rights as this will allow them full access to all photos uploaded on the site, which in return can give them control to moderate images.', 1235068622),
(6305, 'en', 'photo', 'phpfox', '2.0.0alpha1', 'setting_protect_photos_from_public', '<title>Protect Photos</title><info>If you would like to protect the privacy of your members photos set this option to <b>True</b>. By enabling this feature users will not be allowed to view images via their direct path if they do not have permission to view that specific image. This will however add extra queries to the database and can add an extra strain to the server.\r\n\r\n<b>Notice:</b> Apache "mod_rewrite" will have to be enabled to use this feature. Once you have enabled this feature you must edit the file ".htaccess" find in your sites root directory.\r\n\r\nLook for the following in that file:\r\n[code]\r\n# RewriteRule ^file/pic/photo/(.*).(.*)$ static/image.php?file=$1&ext=$2\r\n[/code]\r\n\r\nReplace it with:\r\n[code]\r\nRewriteRule ^file/pic/photo/(.*).(.*)$ static/image.php?file=$1&ext=$2\r\n[/code]\r\n</info>', '<title>Protect Photos</title><info>If you would like to protect the privacy of your members photos set this option to <b>True</b>. By enabling this feature users will not be allowed to view images via their direct path if they do not have permission to view that specific image. This will however add extra queries to the database and can add an extra strain to the server.\r\n\r\n<b>Notice:</b> Apache "mod_rewrite" will have to be enabled to use this feature. Once you have enabled this feature you must edit the file ".htaccess" find in your sites root directory.\r\n\r\nLook for the following in that file:\r\n[code]\r\n# RewriteRule ^file/pic/photo/(.*).(.*)$ static/image.php?file=$1&ext=$2\r\n[/code]\r\n\r\nReplace it with:\r\n[code]\r\nRewriteRule ^file/pic/photo/(.*).(.*)$ static/image.php?file=$1&ext=$2\r\n[/code]\r\n</info>', 1235132674),
