(6310, 'en', 'photo', 'phpfox', '2.0.0alpha1', 'user_setting_photo_mature_age_limit', 'For a photo that is marked as "Mature (Strict)" define the age limit?\r\n\r\n<b>Note:</b>The age you define will allow users with that age or older the ability to view mature photos.', 'For a photo that is marked as "Mature (Strict)" define the age limit?\r\n\r\n<b>Note:</b>The age you define will allow users with that age or older the ability to view mature photos.', 1235502907),
(6311, 'en', 'photo', 'phpfox', '2.0.0alpha1', 'feed_user_add_photos', '<a href="{owner_link}">{owner_full_name}</a> added photos to their album "<a href="{link}">{album_name}</a>".', '<a href="{owner_link}">{owner_full_name}</a> added photos to their album "<a href="{link}">{album_name}</a>".', 1235639996),
(6312, 'en', 'photo', 'phpfox', '2.0.0alpha1', 'setting_can_rate_on_photos', '<title>Photo Rating</title><info>Set to <b>True</b> if you would like to enable the ability for users to rate on photos uploaded by other users.</info>', '<title>Photo Rating</title><info>Set to <b>True</b> if you would like to enable the ability for users to rate on photos uploaded by other users.</info>', 1235920519),
(6313, 'en', 'photo', 'phpfox', '2.0.0alpha1', 'user_setting_can_rate_on_photos', 'Can rate photos?', 'Can rate photos?', 1235920668),
(6314, 'en', 'photo', 'phpfox', '2.0.0alpha1', 'setting_rating_total_photos_cache', '<title>Total Photos to Cache for Rating Section</title><info>Define how many images to cache when rating images. This will load X photos when visiting the rating section and will allow users the ability to rate images at a very fast rate. Once X images have been rated the script will use AJAX to load the next round of X images.\r\n\r\n<b>Notice:</b> "X" is the value of this specific setting.</info>', '<title>Total Photos to Cache for Rating Section</title><info>Define how many images to cache when rating images. This will load X photos when visiting the rating section and will allow users the ability to rate images at a very fast rate. Once X images have been rated the script will use AJAX to load the next round of X images.\r\n\r\n<b>Notice:</b> "X" is the value of this specific setting.</info>', 1235920999),
(6315, 'en', 'photo', 'phpfox', '2.0.0alpha1', 'setting_rating_randomize_photos', '<title>Randomize Photos in the Rating Section</title><info>Set to <b>True</b> if photos within the rating section should be randomized. If set to <b>False</b> we will display images based on the date they were uploaded in descending order.\r\n\r\n<b>Notice:</b> Either setting will allow the users the ability to only rate an image once. Images are not recycled.</info>', '<title>Randomize Photos in the Rating Section</title><info>Set to <b>True</b> if photos within the rating section should be randomized. If set to <b>False</b> we will display images based on the date they were uploaded in descending order.\r\n\r\n<b>Notice:</b> Either setting will allow the users the ability to only rate an image once. Images are not recycled.</info>', 1235921158),
(6316, 'en', 'photo', 'phpfox', '2.0.0alpha1', 'user_setting_can_edit_photo_categories', 'Can edit public photo categories?', 'Can edit public photo categories?', 1235999973),
