(6318, 'en', 'photo', 'phpfox', '2.0.0alpha1', 'setting_photo_battle_image_cache', '<title>Photo Cache for Photo Battle</title><info>Define how many images to cache when display the photo battle.</info>', '<title>Photo Cache for Photo Battle</title><info>Define how many images to cache when display the photo battle.</info>', 1236024195),
(6319, 'en', 'photo', 'phpfox', '2.0.0alpha1', 'user_setting_photo_must_be_approved', 'Set this to <b>True</b> if photos uploaded must be approved before they are visible to the public.', 'Set this to <b>True</b> if photos uploaded must be approved before they are visible to the public.', 1236065652),
(6320, 'en', 'photo', 'phpfox', '2.0.0alpha1', 'user_setting_can_approve_photos', 'Can approve photos that require moderation?', 'Can approve photos that require moderation?', 1236066726),
(6321, 'en', 'photo', 'phpfox', '2.0.0alpha2', 'user_setting_can_feature_photo', 'Can feature a photo?', 'Can feature a photo?', 1237643657),
(6322, 'en', 'photo', 'phpfox', '2.0.0alpha3', 'setting_rename_uploaded_photo_names', '<title>Rename Photo Names</title><info>Set to <b>True</b> if you would like to rename a photo based on what the title of the photo or the title provided by the user when processing their recently uploaded photos. By default we use a 32 character unique hash to protect images, however enabling this feature will still create a unique ID for each image and help with image SEO.\r\n\r\n<b>Notice:</b> Apache "mod_rewrite" will have to be enabled to use this feature. Once you have enabled this feature you must edit the file ".htaccess" find in your sites root directory.\r\n\r\nLook for the following in that file:\r\n[code]\r\n# Rename Photo Names\r\n[/code]\r\nUnder that line you will find 2 lines that have been commented out. Simply uncomment those 2 lines by removing the hash "#" symbol.\r\n</info>', '<title>Rename Photo Names</title><info>Set to <b>True</b> if you would like to rename a photo based on what the title of the photo or the title provided by the user when processing their recently uploaded photos. By default we use a 32 character unique hash to protect images, however enabling this feature will still create a unique ID for each image and help with image SEO.\r\n\r\n<b>Notice:</b> Apache "mod_rewrite" will have to be enabled to use this feature. Once you have enabled this feature you must edit the file ".htaccess" find in your sites root directory.\r\n\r\nLook for the following in that file:\r\n[code]\r\n# Rename Photo Names\r\n[/code]\r\nUnder that line you will find 2 lines that have been commented out. Simply uncomment those 2 lines by removing the hash "#" symbol.\r\n</info>', 1239041807),
