(6779, 'en', 'photo', 'phpfox', '3.5.0beta1', 'setting_show_info_on_mouseover', '<title>Dynamic View</title><info>\r\nThis setting changes a few aspects related to the photo section:<br/>\r\n- It hides the user and album name of a photo until you place the cursor over that photo\r\n- The thumbnails for the photos are bigger\r\n- When placing the mouse over a thumbnail you can like the photo with one click.\r\n- The Pager in the photo section is a bigger button allowing the visitor to simply load more photos.</info>', '<title>Dynamic View</title><info>\r\nThis setting changes a few aspects related to the photo section:<br/>\r\n- It hides the user and album name of a photo until you place the cursor over that photo\r\n- The thumbnails for the photos are bigger\r\n- When placing the mouse over a thumbnail you can like the photo with one click.\r\n- The Pager in the photo section is a bigger button allowing the visitor to simply load more photos.</info>', 1356078187),
