(8881, 'en', 'socialbridge', 'socialbridge', '3.0.0', 'to_get_your_twitter_api', '<li>To get your <strong>"Twitter Consumer Key"</strong> and <strong>"Twitter Consumer Secret"</strong> strings, go to the following URL:\r\n    				<div class="p_4"><a href="https://dev.twitter.com/apps" target="_blank">Make application</a></div>\r\n    			</li>\r\n    			<li>\r\n    				Click to "Create new application" button.\r\n    			</li>', '<li>To get your <strong>"Twitter Consumer Key"</strong> and <strong>"Twitter Consumer Secret"</strong> strings, go to the following URL:\r\n    				<div class="p_4"><a href="https://dev.twitter.com/apps" target="_blank">Make application</a></div>\r\n    			</li>\r\n    			<li>\r\n    				Click to "Create new application" button.\r\n    			</li>', 1325737357),
