(26, 'ceofox', '3.8.0', '$this->database()->query("CREATE TABLE IF NOT EXISTS `" . phpfox::getT(''ceofox_product'') . "` (\r\n  `name` varchar(100) NOT NULL,\r\n  `status` tinyint(1) NOT NULL DEFAULT ''0'',\r\n  `email` varchar(255) DEFAULT NULL,\r\n  `time_install` int(11) DEFAULT NULL,\r\n  `time_verify` int(11) DEFAULT NULL,\r\n  `license_key` varchar(45) DEFAULT NULL,\r\n  `license_id` varchar(45) DEFAULT NULL,\r\n  PRIMARY KEY (`name`)\r\n) ENGINE=MyISAM DEFAULT CHARSET=utf8;");', NULL),
(27, 'follow', '3.0.1', '$this->database()->query("\r\nCREATE TABLE IF NOT EXISTS `".phpfox::getT(''follow'')."` (\r\n  `user_id` int(10) unsigned NOT NULL,\r\n  `follower_id` int(10) unsigned NOT NULL,\r\n  `time_stamp` int(10) unsigned NOT NULL,\r\n  PRIMARY KEY (`user_id`,`follower_id`)\r\n) ENGINE=MyISAM;");\r\n\r\n$this->database()->query("\r\n\r\nCREATE TABLE IF NOT EXISTS `".phpfox::getT(''follow_block'')."` (\r\n  `user_id` int(10) unsigned NOT NULL,\r\n  `blocker_id` int(10) unsigned NOT NULL,\r\n  `time_stamp` int(10) unsigned NOT NULL,\r\n  PRIMARY KEY (`user_id`,`blocker_id`)\r\n) ENGINE=MyISAM;");\r\n\r\n$this->database()->query("\r\n\r\nCREATE TABLE IF NOT EXISTS `".phpfox::getT(''follow_block_all'')."` (\r\n  `user_id` int(10) unsigned NOT NULL,\r\n  PRIMARY KEY (`user_id`)\r\n) ENGINE=MyISAM;");\r\n$this->database()->query("INSERT IGNORE INTO `".phpfox::getT("ceofox_plugins")."` (`plugin_title`, `module_name`, `ph`, `status`, `version`) VALUES\r\n(''Follow like Twitter'', ''follow'', ''1ff1de774005f8da13f42943881c655f'', 0, ''3.0.1'');");', NULL),
(28, 'follow', '3.1.0', '$this->database()->query("\r\n\r\nCREATE TABLE IF NOT EXISTS `".phpfox::getT(''follow_setting'')."` (\r\n  `setting_id` int(10) unsigned NOT NULL AUTO_INCREMENT,\r\n  `user_id` int(10) unsigned NOT NULL,\r\n  `auto_approval` tinyint(1) unsigned NOT NULL DEFAULT ''1'',\r\n  `ask_again` tinyint(1) unsigned NOT NULL DEFAULT ''0'',\r\n  `time_stamp` int(10) unsigned NOT NULL,\r\n  PRIMARY KEY (`setting_id`)\r\n) ENGINE=MyISAM;");\r\n\r\n$this->database()->query("\r\n\r\nCREATE TABLE IF NOT EXISTS `".phpfox::getT(''follow_pending'')."` (\r\n  `pending_id` int(10) unsigned NOT NULL AUTO_INCREMENT,\r\n  `user_id` int(10) unsigned NOT NULL,\r\n  `target_id` int(10) unsigned NOT NULL,\r\n  `time_stamp` int(10) unsigned NOT NULL,\r\n  PRIMARY KEY (`pending_id`)\r\n) ENGINE=MyISAM;");', NULL),
(29, 'follow', '3.2.0', '$this->database()->query("\r\nCREATE TABLE IF NOT EXISTS `".phpfox::getT(''follow_notification'')."` (\r\n  `notification_id` int(10) unsigned NOT NULL AUTO_INCREMENT,\r\n  `item_id` int(10) unsigned NOT NULL,\r\n  `owner_id` int(10) unsigned NOT NULL,\r\n  `owner_type` varchar(255) DEFAULT ''user'',\r\n  `type_id` varchar(255) NOT NULL,\r\n  `user_id` int(10) unsigned NOT NULL,\r\n  `time_stamp` int(10) unsigned NOT NULL,\r\n  PRIMARY KEY (`notification_id`)\r\n) ENGINE=MyISAM  AUTO_INCREMENT=1;");\r\n\r\n$this->database()->query("\r\nCREATE TABLE IF NOT EXISTS `".phpfox::getT(''follow_filter'')."` (\r\n  `filter_id` int(10) unsigned NOT NULL AUTO_INCREMENT,\r\n  `user_id` int(10) unsigned NOT NULL,\r\n  `item_id` int(10) unsigned NOT NULL,\r\n  `type_id` varchar(75) DEFAULT ''user'',\r\n  `feed_type` text,\r\n  `get_noti` tinyint(1) unsigned DEFAULT ''0'',\r\n  `time_stamp` int(10) unsigned NOT NULL,\r\n  PRIMARY KEY (`filter_id`)\r\n) ENGINE=MyISAM AUTO_INCREMENT=1 ;\r\n");\r\n$this->database()->query("UPDATE `".phpfox::getT("ceofox_plugins")."` SET version=''3.2.0'' WHERE ph=''1ff1de774005f8da13f42943881c655f'' ;");\r\n$this->database()->query("alter table `".phpfox::getT("follow")."` DROP PRIMARY KEY");\r\n\r\n$this->database()->query("alter table `".phpfox::getT("follow")."` add column `id` int(10) unsigned NOT NULL AUTO_INCREMENT PRIMARY KEY");\r\n\r\n$this->database()->query("alter table `".phpfox::getT("follow")."` add column `type_id` varchar(75) DEFAULT ''user''");\r\n\r\n\r\n$this->database()->query("alter table `".phpfox::getT("follow_block")."` DROP PRIMARY KEY");\r\n\r\n$this->database()->query("alter table `".phpfox::getT("follow_block")."` add column `id` int(10) unsigned NOT NULL AUTO_INCREMENT PRIMARY KEY");\r\n\r\n$this->database()->query("alter table `".phpfox::getT("follow_block")."` add column `type_id` varchar(75) DEFAULT ''user''");\r\n\r\n\r\n$this->database()->query("alter table `".phpfox::getT("follow_block_all")."` DROP PRIMARY KEY");\r\n\r\n$this->database()->query("alter table `".phpfox::getT("follow_block_all")."` add column `id` int(10) unsigned NOT NULL AUTO_INCREMENT PRIMARY KEY");\r\n\r\n$this->database()->query("alter table `".phpfox::getT("follow_block_all")."` add column `type_id` varchar(75) DEFAULT ''user''");\r\n\r\n$this->database()->query("alter table `".phpfox::getT("follow_pending")."` add column `type_id` varchar(75) DEFAULT ''user''");\r\n\r\n$this->database()->query("alter table `".phpfox::getT("follow_setting")."` add column `type_id` varchar(75) DEFAULT ''user''");\r\n\r\n$this->database()->query("alter table `".phpfox::getT("follow_setting")."` change `user_id` `item_id` int(10) unsigned NOT NULL");\r\n\r\n$this->database()->query("alter table `".phpfox::getT("follow")."` change `follower_id` `item_id` int(10) unsigned NOT NULL");\r\n\r\n$this->database()->query("alter table `".phpfox::getT("follow_block")."` change`blocker_id` `item_id` int(10) unsigned NOT NULL");\r\n\r\n$this->database()->query("alter table `".phpfox::getT("follow_block_all")."` change `user_id` `item_id` int(10) unsigned NOT NULL");\r\n\r\n$this->database()->query("alter table `".phpfox::getT("follow_pending")."` change `target_id` `item_id` int(10) unsigned NOT NULL");', NULL),
(30, 'cfshare', '3.1.0', '$this->database()->query("CREATE TABLE IF NOT EXISTS `".phpfox::getT("cfshare_module")."` (\r\n  `item_id` int(10) unsigned NOT NULL AUTO_INCREMENT,\r\n  `item_type` varchar(75) NOT NULL,\r\n  `is_active` tinyint(1) unsigned NOT NULL DEFAULT ''1'',\r\n  PRIMARY KEY (`item_id`)\r\n) ENGINE=MyISAM ;");\r\n\r\n\r\n$this->database()->query("CREATE TABLE IF NOT EXISTS `".phpfox::getT("cfshare")."` (\r\n  `link_id` int(10) unsigned NOT NULL AUTO_INCREMENT,\r\n  `user_id` int(10) unsigned NOT NULL,\r\n  `module_id` varchar(75) DEFAULT NULL,\r\n  `item_id` int(10) unsigned NOT NULL DEFAULT ''0'',\r\n  `parent_user_id` int(10) unsigned NOT NULL DEFAULT ''0'',\r\n  `is_custom` tinyint(1) NOT NULL DEFAULT ''0'',\r\n  `link` varchar(255) NOT NULL,\r\n  `image` varchar(255) DEFAULT NULL,\r\n  `title` varchar(255) DEFAULT NULL,\r\n  `description` varchar(255) DEFAULT NULL,\r\n  `status_info` mediumtext,\r\n  `privacy` tinyint(1) NOT NULL,\r\n  `privacy_comment` tinyint(1) NOT NULL,\r\n  `time_stamp` int(10) unsigned NOT NULL,\r\n  `has_embed` tinyint(1) NOT NULL DEFAULT ''0'',\r\n  `total_comment` int(10) unsigned NOT NULL DEFAULT ''0'',\r\n  `total_like` int(10) unsigned NOT NULL DEFAULT ''0'',\r\n  `total_dislike` int(10) unsigned NOT NULL DEFAULT ''0'',\r\n  PRIMARY KEY (`link_id`),\r\n  KEY `parent_user_id` (`parent_user_id`)\r\n) ENGINE=MyISAM ;");', NULL),
